
    var docsSearchIndex = [{"title":"Documentation","contents":"                          Documentation      Select a member of the Truffle Suite to learn more.                                        TRUFFLE                                                            Ganache                                                            drizzle                          SIGN UP FOR THE TRUFFLE MAILING LIST    Sign up today to be a member of the Truffle mailing list. You'll be added to our low volume mailing list which we'll use to communicate future changes, development ideas and allow you to shape Truffle's development.                            Email                                    First Name                                                                            See a way to make this page better? Edit here »                  "},{"title":"Ganache | Overview","contents":"                        Star  Fork                Ganache Overview      Ganache is a personal blockchain for Ethereum development you can use to deploy contracts, develop your applications, and run tests.It is available as both a desktop application as well as a command-line tool (formerly known as the TestRPC). Ganache is available for Windows, Mac, and Linux.                      See a way to make this page better? Edit here »                  "},{"title":"Ganache | Ganache Quickstart","contents":"                          Ganache Quickstart      Ganache is a personal blockchain for Ethereum development you can use to deploy contracts, develop your applications, and run tests.It is available as both a desktop application as well as a command-line tool (formerly known as the TestRPC). Ganache is available for Windows, Mac, and Linux.                Installation                      Ganache      Download the appropriate version for your OS:Windows: Ganache-*.appxMac: Ganache-*.dmgLinux: Ganache-*.AppImageDouble-click on the downloaded file, follow the prompts, and you're up and running.                Ganache CLI      If you are interested in the command-line version (formerly known as the TestRPC), you can get it through npm.npm install -g ganache-cliThis page will focus only on the graphical interface. Please see the README for more information on Ganache CLI.                Main interface      When you launch Ganache, the screen will show some details about the server, and also list out a number of accounts. Each account is given 100 ether. Having ether automatically in all accounts allows you to focus on developing your application.Note: The first time you launch Ganache, you will be asked if you want to allow Google Analytics tracking. While optional, turning this on will help the development team gain more insight into how Ganache is used. This tracking is totally anonymous, and no account data or private keys will ever be shared.          Ganache AccountsThere are four pages available:The Accounts page shows the accounts generated and their balances. This is the default view.The Blocks page shows each block as mined on the blockchain, along with gas used and transactions.The Transactions page lists all transactions run against the blockchain.The Logs page shows the logs for the server, which is useful for debugging. Also note that you can search for block numbers or transaction hashes from a search box at the top.                Settings      You can change some features of the generated blockchain through the Settings pages, accessed by the gear icon in the top right corner.          Ganache SettingsThe Server page shows details about the network connection, including hostname, port, network ID, and whether to automatically mine each transaction into a block.The Accounts & Keys page sets details about the number of accounts created, and whether to use a specific mnemonic or let Ganache generate its own.The Chain page sets details about the actual workings of the generated blockchain, including gas limit and gas price.The Advanced page toggles Google Analytics, which is useful for the Ganache team to track usage of the application.After making changes, you will have to click Restart on the application for the changes to take effect.                      See a way to make this page better? Edit here »                  "},{"title":"Drizzle | Overview","contents":"                        Star  Fork                Drizzle Overview      Drizzle is a collection of front-end libraries that make writing dapp front-ends easier and more predictable. The core of Drizzle is based on a Redux store, so you have access to the spectacular development tools around Redux. We take care of synchronizing your contract data, transaction data and more. Things stay fast because you declare what to keep in sync.Fully reactive contract data, including state, events and transactions.Declarative, so you're not wasting valuable cycles on unneeded data.Maintains access to underlying functionality. Web3 and your contract's methods are still there, untouched.                      See a way to make this page better? Edit here »                  "},{"title":"Drizzle | Drizzle Quickstart","contents":"                          Drizzle Quickstart                      Installation      Install Drizzle via npm:npm install --save drizzleUsing React?: The easiest way to get started with Drizzle is to use our official drizzle-react package and (optionally) its companion drizzle-react-components.                Initialization      Note: Since Drizzle uses web3 1.0 and web sockets, be sure your development environment can support these. As a development blockchain, you'll need ganache-cli v6.1.0+, geth or parity.Import the provider.import { Drizzle, generateStore } from 'drizzle'Create an options object and pass in the desired contract artifacts for Drizzle to instantiate. Other options are available, see the Options section.// Import contractsimport SimpleStorage from './../build/contracts/SimpleStorage.json'import TutorialToken from './../build/contracts/TutorialToken.json'const options = {  contracts: [    SimpleStorage  ]}const drizzleStore = generateStore(this.props.options)const drizzle = new Drizzle(this.props.options, drizzleStore)Note: The above assumes you have no existing redux store and generates a new one. To use your existing redux store, see Using an Existing Redux Store.                      See a way to make this page better? Edit here »                  "},{"title":"Drizzle | Contract Interaction","contents":"                          Contract Interaction      Drizzle provides helpful methods on top of the default web3.Contract methods to keep your calls and transactions in sync with the store.                cacheCall()      Gets contract data. Calling the cacheCall() function on a contract will execute the desired call and return a corresponding key so the data can be retrieved from the store. When a new block is received, Drizzle will refresh the store automatically _if_ any transactions in the block touched our contract. For more information on how this works, see How Data Stays Fresh.Note: We have to check that Drizzle is initialized before fetching data. A simple if statement such as below is fine for displaying a few pieces of data, but a better approach for larger dapps is to use a loading component. We've already built one for you in our drizzle-react-components library as well.// Assuming we're observing the store for changes.var state = drizzle.store.getState()// If Drizzle is initialized (and therefore web3, accounts and contracts), continue.if (state.drizzleStatus.initialized) {    // Declare this call to be cached and synchronized. We'll receive the store key for recall.    const dataKey = drizzle.contracts.SimpleStorage.methods.storedData.cacheCall()    // Use the dataKey to display data from the store.    return state.contracts.SimpleStorage.methods.storedData[dataKey].value}// If Drizzle isn't initialized, display some loading indication.return 'Loading...'The contract instance has all of its standard web3 properties and methods. For example, you could still call as normal if you don't want something in the store:drizzle.contracts.SimpleStorage.methods.storedData().call()                cacheSend()      Sends a contract transaction. Calling the cacheSend() function on a contract will send the desired transaction and return a corresponding transaction hash so the status can be retrieved from the store. The last argument can optionally be an options object with the typical from, gas and gasPrice keys. Drizzle will update the transaction's state in the store (pending, success, error) and store the transaction receipt. For more information on how this works, see How Data Stays Fresh.Note: We have to check that Drizzle is initialized before fetching data. A simple if statement such as below is fine for displaying a few pieces of data, but a better approach for larger dapps is to use a loading component. We've already built one for you in our drizzle-react-components library as well.// Assuming we're observing the store for changes.var state = drizzle.store.getState()// If Drizzle is initialized (and therefore web3, accounts and contracts), continue.if (state.drizzleStatus.initialized) {    // Declare this transaction to be observed. We'll receive the stackId for reference.    const stackId = drizzle.contracts.SimpleStorage.methods.set.cacheSend(2, {from: '0x3f...'})    // Use the dataKey to display the transaction status.    if (state.transactionStack[stackId]) {        const txHash = state.transactionStack[stackId]        return state.transactions[txHash].status    }}// If Drizzle isn't initialized, display some loading indication.return 'Loading...'For more information on what's contained in transaction state, see Drizzle State.The contract instance has all of its standard web3 properties and methods. For example, you could still send as normal if you don't want a tx in the store:drizzle.contracts.SimpleStorage.methods.set(2).send({from: '0x3f...'})                Adding Contracts Dynamically      You can programmatically add contracts to Drizzle using either drizzle.addContract() or the ADD_CONTRACT action.var contractConfig = {  contractName: \"0x066408929e8d5Ed161e9cAA1876b60e1fBB5DB75\",  web3Contract: new web3.eth.Contract(/* ... */)}events = ['Mint']// Using an actiondispatch({type: 'ADD_CONTRACT', drizzle, contractConfig, events, web3})// Or using the Drizzle context objectthis.context.drizzle.addContract(contractConfig, events)                      See a way to make this page better? Edit here »                  "},{"title":"Drizzle | Using an Existing Redux Store","contents":"                          Using an Existing Redux Store      Drizzle is flexible about its store. It can generate a store if your app doesn't currently use redux, live alongside your current store (potentially keeping all Ethereum concerns in one place) or integrating its reducers and sagas with your currently existing store.                Single Store      If you'd like to integrate Drizzle's reducers and sagas with your existing store, import them for use alongside your existing reducers. In this example, we already have react-router-redux keeping the state of react-router in our store.import { combineReducers } from 'redux'import { routerReducer } from 'react-router-redux'import { drizzleReducers } from 'drizzle'const reducer = combineReducers({  routing: routerReducer,  ...drizzleReducers})export default reducerSimilarly, we can import Drizzle's sagas as well. For more information on how this works, see the example just above the \"Making our code testable\" section of the redux-saga beginner tutorial.import { all, fork } from 'redux-saga/effects'import { drizzleSagas } from 'drizzle'export default function* root() {  yield all(    drizzleSagas.map(saga => fork(saga))  )}Now we can use the reducers and sagas as we normally would in our store. Note that we must also generate an initial state for our contracts. Drizzle takes care of this for you with the generateContractsInitialState function.// ...import { generateContractsInitialState } from 'drizzle'import drizzleOptions from './drizzleOptions'// ...const initialState = {  contracts: generateContractsInitialState(drizzleOptions)}const store = createStore(  reducer,  initialState,  composeEnhancers(    applyMiddleware(      thunkMiddleware,      routingMiddleware,      sagaMiddleware    )  ))sagaMiddleware.run(rootSaga)Finally, use the store as your normally would. In this example, we're using the <DrizzleProvider> from drizzle-react.// ...import store from './store'// ...ReactDOM.render((    <DrizzleProvider options={drizzleOptions} store={store}>      <LoadingContainer>        <Router history={history}>          <Route path=\"/\" component={App}>            <IndexRoute component={HomeContainer} />          </Route>        </Router>      </LoadingContainer>    </DrizzleProvider>  ),  document.getElementById('root'));                Multiple Stores      There are reasons you may want multiple stores in your application. If you're working with a large, existing webapp, you may want to keep the Ethereum portions of it separated. From the Redux Documentation's Store Setup section:Isolating a Redux app as a component in a bigger application, in which case you might want to create a store per root component instance.If you're using React and drizzle-react, you can achieve this by not passing a store to the <DrizzleProvider> and wrapping your existing <Provider> component.// ...import { DrizzleProvider } from 'drizzle-react'// ...ReactDOM.render((    <DrizzleProvider options={options}>      <Provider store={store}>        <LoadingContainer>          <Router history={history}>            <Route path=\"/\" component={App}>              <IndexRoute component={HomeContainer} />            </Route>          </Router>        </LoadingContainer>      </Provider>    </DrizzleProvider>  ),  document.getElementById('root'));                      See a way to make this page better? Edit here »                  "},{"title":"Drizzle | React Components","contents":"                          Drizzle React Components      A set of useful components for common UI elements.                Installation      Install Drizzle React Components via npm:npm install --save drizzle-react-componentsNote: You'll also need the drizzle-react package, if it isn't already installed.                Components                      LoadingContainer      This components wraps your entire app (but within the DrizzleProvider) and will show a loading screen until Drizzle, and therefore web3 and your contracts, are initialized.loadingComp (component) The component displayed while Drizzle intializes.errorComp (component) The component displayed if Drizzle initialization fails.                ContractData      contract (string, required) Name of the contract to call.method (string, required) Method of the contract to call.methodArgs (array) Arguments for the contract method call. EX: The address for an ERC20 balanceOf() function. The last argument can optionally be an options object with the typical from, gas and gasPrice keys.hideIndicator (boolean) If true, hides the loading indicator during contract state updates. Useful for things like ERC20 token symbols which do not change.toUtf8 (boolean) Converts the return value to a UTF-8 string before display.toAscii (boolean) Converts the return value to an Ascii string before display.                ContractForm      contract (string, required) Name of the contract whose method will be the basis the form.method (string, required) Method whose inputs will be used to create corresponding form fields.sendArgs (object) An object specifying options for the transaction to be sent; namely: from, gasPrice, gas and value. Further explanataion of these parameters can be found here in the web3 documentation.labels (array) Custom labels; will follow ABI input ordering. Useful for friendlier names. For example \"_to\" becoming \"Recipient Address\".                      See a way to make this page better? Edit here »                  "},{"title":"Drizzle | React Integration","contents":"                          React Integration      drizzle-react is the official way to integrate Drizzle with your React dapp.Check out the Drizzle Truffle Box for a complete example (also featuring drizzle-react-components), or continue reading to create your own setup.                Installation      Install Drizzle React Components via npm:npm install --save drizzle-reactNote: drizzle-react requires Requires React 0.14 or greater. You'll also need the drizzle package, if it isn't already installed.                Getting Started      Note: Since Drizzle uses web3 1.0 and web sockets, be sure your development environment can support these.Import the provider.import { DrizzleProvider } from 'drizzle-react'Create an options object and pass in the desired contract artifacts for Drizzle to instantiate. Other options are available, see the Options section of the Drizzle docs below.// Import contractsimport SimpleStorage from './../build/contracts/SimpleStorage.json'import TutorialToken from './../build/contracts/TutorialToken.json'const options = {  contracts: [    SimpleStorage,    TutorialToken  ]}Wrap your app with DrizzleProvider and pass in an options object.<DrizzleProvider options={options}>  <App /></DrizzleProvider>Wrap your components using the drizzleConnect function. It has the same API as the connect() function in react-redux. See their docs here.import { drizzleConnect } from 'drizzle-react'const mapStateToProps = state => {  return {    drizzleStatus: state.drizzleStatus,    SimpleStorage: state.contracts.SimpleStorage  }}const HomeContainer = drizzleConnect(Home, mapStateToProps);See Drizzle State in the Drizzle docs for the entire state tree.Get contract data by accessing the contracts via context. Calling the data() function on a contract will first check the store for a cached result. If empty, Drizzle will query the blockchain and cache the response for future use. For more information on how this works, see How Data Stays Fresh in the Drizzle docs.Note: We have to check that Drizzle is initialized before fetching data. A one-liner such as below is fine for display a few pieces of data, but a better approach for larger dapps is to use a loading component.// For convenienceconstructor(props, context) {  super(props)  this.contracts = context.drizzle.contracts}// If Drizzle is initialized (and therefore web3, accounts and contracts), fetch data.// This will update automatically when the contract state is altered.var storedData = this.props.drizzleStatus.initialized ? this.contracts.SimpleStorage.methods.storedData.data() : 'Loading...'The contract instance has all of its standard web3 properties and methods. For example, sending a transaction is done as normal:this.contracts.SimpleStorage.methods.set(this.state.storageAmount).send()                Recipe: Loading Component      The following wrapper and component will detect when your dapp isn't ready and allow you to display the appropriate status or course of action:LoadingContainer.jsimport Loading from './Loading.js'import { drizzleConnect } from 'drizzle-react'// May still need this even with data function to refresh component on updates for this contract.const mapStateToProps = state => {  return {    drizzleStatus: state.drizzleStatus,    web3: state.web3  }}const LoadingContainer = drizzleConnect(Loading, mapStateToProps);export default LoadingContainerLoading.jsimport React, { Component, Children } from 'react'class Loading extends Component {  constructor(props, context) {    super(props)  }  render() {    if (this.props.web3.status === 'failed')    {      return(        // Display a web3 warning.        <main>          <h1>⚠️</h1>          <p>This browser has no connection to the Ethereum network. Please use the Chrome/FireFox extension MetaMask, or dedicated Ethereum browsers Mist or Parity.</p>        </main>      )    }    if (this.props.drizzleStatus.initialized)    {      // Load the dapp.      return Children.only(this.props.children)    }    return(      // Display a loading indicator.      <main>        <h1>⚙️</h1>        <p>Loading dapp...</p>      </main>    )  }}export default Loading                      See a way to make this page better? Edit here »                  "},{"title":"Drizzle | Drizzle Options","contents":"                          Drizzle Options      {  contracts,  events: {    contractName: [      eventName,      {        eventName,        eventOptions      }    ]  },  polls: {    accounts: interval,    blocks: interval  },  syncAlways,  web3: {    fallback: {      type      url    }  }}                contracts (array)      An array of either contract artifact files or Web3 contract objects. The objects have a contractName and web3Contract key.i.e.contracts: [  truffleArtifact, // A regular Truffle contract artifact  {    contractName: 'RegisteredContract',    web3Contract: new web3.eth.Contract(abi, address, {data: 'deployedBytecode' }) // An instance of a Web3 contract  }]                events (object)      An object consisting of contract names each containing an array of strings of the event names we'd like to listen for and sync with the store. Furthermore, event names may be replaced with an object containing both eventName and eventOptions, where eventOptions field corresponds to the web3 Contract.events options.                polls (object)      An object containing key/value pairs denoting what is being polled and the interval (in ms). Possible polls are accounts and blocks. Accounts will poll for addresses and balances, blocks for new blocks. Default: { blocks: 3000 }                syncAlways (boolean)      If true, will replay all contract calls at every block. This is useful if your dapp uses a proxy contract which obfuscates your primary contract's address. By default Drizzle checks blocks to see if a transaction interacting with your contracts has occured. If so, it syncs that contract. Default: false                web3 (object)      Options regarding web3 instantiation.                fallback (object)      An object consisting of the type and url of a fallback web3 provider. This is used if no injected provider, such as MetaMask or Mist, is detected.type (string): The type of the fallback web3 provider. Currently the only possibility is 'ws' (web socket). Default: 'ws'url (string): The full fallback web3 provider url. Default: 'ws://127.0.0.1:8545'                      See a way to make this page better? Edit here »                  "},{"title":"Drizzle | Drizzle State","contents":"                          Drizzle State      {  accounts,  accountBalances: {    address  }  contracts: {    contractName: {      initialized,      synced,      events,      callerFunctionName: {        argsHash: {          args,          value        }      }    }  },  transactions: {    txHash: {      confirmations,      error,      receipt,      status    }  },  transactionStack  drizzleStatus: {    initialized  }  web3: {    status  }}                accounts (array)      An array of account addresses from web3.                accountBalances (object)      An object whose keys are account addresses and values are account balances (in Wei).                contracts (object)      A series of contract state objects, indexed by the contract name as declared in its ABI.                contractName (object)      initialized (boolean): true once contract is fully instantiated.synced (boolean): false if contract state changes have occurred in a block and Drizzle is re-running its calls.events (array): An array of event objects. Drizzle will only listen for the events we declared in options.The contract's state also includes the state of each constant function called on the contract (callerFunctionName). The functions are indexed by name, and contain the outputs indexed by a hash of the arguments passed during the call (argsHash). If no arguments were passed, the hash is 0x0. Drizzle reads from the store for you, so it should be unnecessary to touch this data cache manually.args (array): Arguments passed to function call.value (mixed): Value returned from function call.                transactions (object)      A series of transaction objects, indexed by transaction hash.                txHash (object)      confirmations (array): After the initial receipt, further confirmation receipts (up to the 24th).error (object): contains the returned error if any.receipt (object): contains the first transaction receipt received from a transaction's success event.status (string): true or false depending on transaction statuspending when the transaction has broadcasted successfully, but is not yet minedsuccess when a transaction receipt has been received (you may also wish to check for further confirmations)error if any errors occurred after broadcastingFor more in-depth information on the Ethereum transaction lifecycle, check out this great blog post.                transactionStack (array)      In some cases, a transaction may be malformed and not even make it to being broadcasted. To keep track of this, an empty string will be added to this array and replaced with the transaction hash once broascasted. The cacheSend() method will return a stackId, which will allow you to observe this process for your own transaction status indicator UI.                drizzleStatus (object)      An object containing information about the status of Drizzle.initialized (boolean): true once:web3 is found or instantiatedAccount addresses are stored in stateAll contracts are instantiated                initialized (boolean)      false by default, becomes true once a web3 instance is found and the accounts and contracts are fetched.                web3 (object)      status (string): initializing, initialized and failed are possible options. Useful for triggering warnings if web3 fails to instantiate.                      See a way to make this page better? Edit here »                  "},{"title":"Drizzle | How Data Stays Fresh","contents":"                          How Data Stays Fresh      Once initialized, Drizzle instantiates web3 and our desired contracts, then observes the chain by subscribing to new block headers.          Drizzle keeps track of contract calls so it knows what to synchronize.          When a new block header comes in, Drizzle checks that the block isn't pending, then goes through the transactions looking to see if any of them touched our contracts.          If they did, we replay the calls already in the store to refresh any potentially altered data. If they didn't we continue with the store data.                                See a way to make this page better? Edit here »                  "},{"title":"Truffle | Overview","contents":"                        Star  Fork                Truffle Overview      A world class development environment, testing framework and asset pipeline for blockchains using the Ethereum Virtual Machine (EVM), aiming to make life as a developer easier. With Truffle, you get:Built-in smart contract compilation, linking, deployment and binary management.Automated contract testing for rapid development.Scriptable, extensible deployment & migrations framework.Network management for deploying to any number of public & private networks.Package management with EthPM & NPM, using the ERC190 standard.Interactive console for direct contract communication.Configurable build pipeline with support for tight integration.External script runner that executes scripts within a Truffle environment.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Truffle Quickstart","contents":"                          Truffle Quickstart      This page will take you through the basics of creating a Truffle project and deploying a smart contract to a blockchain.Note: Before you begin, make sure that you read our Ethereum Overview page.                Table of Contents      Creating a projectExploring the projectTestingCompilingMigrating with Truffle DevelopAlternative: Migrating with GanacheInteracting with the contract                Creating a project      To use most Truffle commands, you need to run them against an existing Truffle project. So the first step is to create a Truffle project.You can create a bare project template, but for those just getting started, you can use Truffle Boxes, which are example applications and project templates. We'll use the MetaCoin box, which creates a token that can be transferred between accounts:Create a new directory for your Truffle project:mkdir MetaCoincd MetaCoinDownload (\"unbox\") the MetaCoin box:truffle unbox metacoinNote: You can use the truffle unbox <box-name> command to download any of the other Truffle Boxes.Note: To create a bare Truffle project with no smart contracts included, use truffle init.Once this operation is completed, you'll now have a project structure with the following items:contracts/: Directory for Solidity contractsmigrations/: Directory for scriptable deployment filestest/: Directory for test files for testing your application and contractstruffle.js: Truffle configuration file                Exploring the project      Note: This page is just a quickstart, so we're not going to go into much detail here. Please see the rest of the Truffle documentation to learn more.Open the contracts/MetaCoin.sol file in a text editor. This is a smart contract (written in Solidity) that creates a MetaCoin token. Note that this also references another Solidity file contracts/ConvertLib.sol in the same directory.Open the contracts/Migrations.sol file. This is a separate Solidity file that manages and updates the status of your deployed smart contract. This file comes with every Truffle project, and is usually not edited. Open the migrations/1_initial_migration.js file. This file is the migration (deployment) script for the Migrations contract found in the Migrations.sol file.Open the migrations/2_deploy_contracts.js file. This file is the migration script for the MetaCoin contract. (Migration scripts are run in order, so the file beginning with 2 will be run after the file beginning with 1.)Open the test/TestMetacoin.sol file. This is a test file written in Solidity which ensures that your contract is working as expected.Open the test/metacoin.js file. This is a test file written in JavaScript which performs a similar function to the Solidity test above.Open the truffle.js file. This is the Truffle configuration file, for setting network information and other project-related settings. The file is blank, but this is okay, as we'll be using a Truffle command that has some defaults built-in.                Testing      On a terminal, run the Solidity test:truffle test ./test/TestMetacoin.solYou will see the following output  TestMetacoin    √ testInitialBalanceUsingDeployedContract (71ms)    √ testInitialBalanceWithNewMetaCoin (59ms)  2 passing (794ms)Note: If you're on Windows and encountering problems running this command, please see the documentation on resolving naming conflicts on Windows.These tree tests were run against the contract, with descriptions displayed on what the tests are supposed to do.Run the JavaScript test:truffle test ./test/metacoin.jsYou will see the following output  Contract: MetaCoin    √ should put 10000 MetaCoin in the first account    √ should call a function that depends on a linked library (40ms)    √ should send coin correctly (129ms)  3 passing (255ms)                Compiling      Compile the smart contracts:truffle compileYou will see the following output:Compiling .\\contracts\\ConvertLib.sol...Compiling .\\contracts\\MetaCoin.sol...Compiling .\\contracts\\Migrations.sol...Writing artifacts to .\\build\\contracts                Migrating with Truffle Develop      Note: To use Ganache, please skip to the next section.To deploy our smart contracts, we're going to need to connect to a blockchain. Truffle has a built-in personal blockchain that can be used for testing. This blockchain is local to your system and does not interact with the main Ethereum network.You can create this blockchain and interact with it using Truffle Develop.Run Truffle Develop:truffle developYou will see the following information:Truffle Develop started at http://127.0.0.1:9545/Accounts:(0) 0x627306090abab3a6e1400e9345bc60c78a8bef57(1) 0xf17f52151ebef6c7334fad080c5704d77216b732(2) 0xc5fdf4076b8f3a5357c5e395ab970b5b54098fef(3) 0x821aea9a577a9b44299b9c15c88cf3087f3b5544(4) 0x0d1d4e623d10f9fba5db95830f7d3839406c6af2(5) 0x2932b7a2355d6fecc4b5c0b6bd44cc31df247a2e(6) 0x2191ef87e392377ec08e7c08eb105ef5448eced5(7) 0x0f4f2ac550a1b4e2280d04c21cea7ebd822934b5(8) 0x6330a553fc93768f612722bb8c2ec78ac90b3bbc(9) 0x5aeda56215b167893e80b4fe645ba6d5bab767dePrivate Keys:(0) c87509a1c067bbde78beb793e6fa76530b6382a4c0241e5e4a9ec0a0f44dc0d3(1) ae6ae8e5ccbfb04590405997ee2d52d2b330726137b875053c36d94e974d162f(2) 0dbbe8e4ae425a6d2687f1a7e3ba17bc98c673636790f1b8ad91193c05875ef1(3) c88b703fb08cbea894b6aeff5a544fb92e78a18e19814cd85da83b71f772aa6c(4) 388c684f0ba1ef5017716adb5d21a053ea8e90277d0868337519f97bede61418(5) 659cbb0e2411a44db63778987b1e22153c086a95eb6b18bdf89de078917abc63(6) 82d052c865f5763aad42add438569276c00d3d88a2d062d36b2bae914d58b8c8(7) aa3680d5d48a8283413f7a108367c7299ca73f553735860a87b08f39395618b7(8) 0f62d96d6675f32685bbdb8ac13cda7c23436f63efbb9d07700d8669ff12b7c4(9) 8d5366123cb560bb606379f90a0bfd4769eecc0557f1b362dcae9012b548b1e5Mnemonic: candy maple cake sugar pudding cream honey rich smooth crumble sweet treat⚠️  Important ⚠️  : This mnemonic was created for you by Truffle. It is not secure.Ensure you do not use it on production blockchains, or else you risk losing funds.   truffle(development)>This shows ten accounts (and their private keys) that can be used when interacting with the blockchain.On the Truffle Develop prompt, Truffle commands can be run by omitting the truffle prefix. For example, to run truffle compile on the prompt, type compile. The command to deploy your compiled contracts to the blockchain is truffle migrate, so at the prompt, type:migrateYou will see the following output:Starting migrations...======================> Network name:    'develop'> Network id:      4447> Block gas limit: 67219751_initial_migration.js======================   Deploying 'Migrations'   ----------------------   > transaction hash:    0x3fd222279dad48583a3320decd0a2d12e82e728ba9a0f19bdaaff98c72a030a2   > Blocks: 0            Seconds: 0   > contract address:    0xa0AdaB6E829C818d50c75F17CFCc2e15bfd55a63   > account:             0x627306090abab3a6e1400e9345bc60c78a8bef57   > balance:             99.99445076   > gas used:            277462   > gas price:           20 gwei   > value sent:          0 ETH   > total cost:          0.00554924 ETH      > Saving migration to chain.   > Saving artifacts   -------------------------------------   > Total cost:          0.00554924 ETH2_deploy_contracts.js=====================   Deploying 'ConvertLib'   ----------------------   > transaction hash:    0x97e8168f1c05fc40dd8ffc529b9a2bf45cc7c55b07b6b9a5a22173235ee247b6   > Blocks: 0            Seconds: 0   > contract address:    0xfb39FeaeF3ac3fd46e2123768e559BCe6bD638d6   > account:             0x627306090abab3a6e1400e9345bc60c78a8bef57   > balance:             99.9914458   > gas used:            108240   > gas price:           20 gwei   > value sent:          0 ETH   > total cost:          0.0021648 ETH   Linking   -------   * Contract: MetaCoin <--> Library: ConvertLib (at address: 0xfb39FeaeF3ac3fd46e2123768e559BCe6bD638d6)   Deploying 'MetaCoin'   --------------------   > transaction hash:    0xee4994097c10e7314cc83adf899d67f51f22e08b920e95b6d3f75c5eb498bde4   > Blocks: 0            Seconds: 0   > contract address:    0x6891Ac4E2EF3dA9bc88C96fEDbC9eA4d6D88F768   > account:             0x627306090abab3a6e1400e9345bc60c78a8bef57   > balance:             99.98449716   > gas used:            347432   > gas price:           20 gwei   > value sent:          0 ETH   > total cost:          0.00694864 ETH   > Saving migration to chain.   > Saving artifacts   -------------------------------------   > Total cost:          0.00911344 ETHSummary=======> Total deployments:   3> Final cost:          0.01466268 ETHThis shows the transaction IDs and addresses of your deployed contracts. It also includes a cost summary and real-time status updates.  Note: Your transaction hashes, contract addresses, and accounts will be different from the above.Note: To see how to interact with the contract, please skip to the next section.                Alternative: Migrating with Ganache      While Truffle Develop is an all-in-one personal blockchain and console, you can also use Ganache, a desktop application, to launch your personal blockchain. Ganache can be a more easy-to-understand tool for those new to Ethereum and the blockchain, as it displays much more information up-front.The only extra step, aside from running Ganache, is that it requires editing the Truffle configuration file to point to the Ganache instance.Download and install Ganache.Open truffle.js in a text editor. Replace the content with the following:module.exports = {  networks: {    development: {      host: \"127.0.0.1\",      port: 7545,      network_id: \"*\"    }  }};This will allow a connection using Ganache's default connection parameters.Save and close that file.Launch Ganache.          GanacheOn the terminal, migrate the contract to the blockchain created by Ganache:truffle migrateYou will see the following outputStarting migrations...======================> Network name:    'develop'> Network id:      4447> Block gas limit: 67219751_initial_migration.js======================   Deploying 'Migrations'   ----------------------   > transaction hash:    0x3fd222279dad48583a3320decd0a2d12e82e728ba9a0f19bdaaff98c72a030a2   > Blocks: 0            Seconds: 0   > contract address:    0xa0AdaB6E829C818d50c75F17CFCc2e15bfd55a63   > account:             0x627306090abab3a6e1400e9345bc60c78a8bef57   > balance:             99.99445076   > gas used:            277462   > gas price:           20 gwei   > value sent:          0 ETH   > total cost:          0.00554924 ETH      > Saving migration to chain.   > Saving artifacts   -------------------------------------   > Total cost:          0.00554924 ETH2_deploy_contracts.js=====================   Deploying 'ConvertLib'   ----------------------   > transaction hash:    0x97e8168f1c05fc40dd8ffc529b9a2bf45cc7c55b07b6b9a5a22173235ee247b6   > Blocks: 0            Seconds: 0   > contract address:    0xfb39FeaeF3ac3fd46e2123768e559BCe6bD638d6   > account:             0x627306090abab3a6e1400e9345bc60c78a8bef57   > balance:             99.9914458   > gas used:            108240   > gas price:           20 gwei   > value sent:          0 ETH   > total cost:          0.0021648 ETH   Linking   -------   * Contract: MetaCoin <--> Library: ConvertLib (at address: 0xfb39FeaeF3ac3fd46e2123768e559BCe6bD638d6)   Deploying 'MetaCoin'   --------------------   > transaction hash:    0xee4994097c10e7314cc83adf899d67f51f22e08b920e95b6d3f75c5eb498bde4   > Blocks: 0            Seconds: 0   > contract address:    0x6891Ac4E2EF3dA9bc88C96fEDbC9eA4d6D88F768   > account:             0x627306090abab3a6e1400e9345bc60c78a8bef57   > balance:             99.98449716   > gas used:            347432   > gas price:           20 gwei   > value sent:          0 ETH   > total cost:          0.00694864 ETH   > Saving migration to chain.   > Saving artifacts   -------------------------------------   > Total cost:          0.00911344 ETHSummary=======> Total deployments:   3> Final cost:          0.01466268 ETHThis shows the transaction IDs and addresses of your deployed contracts. It also includes a cost summary and real-time status updates.  Note: Your transaction IDs and contract addresses will be different from the above.In Ganache, click the \"Transactions\" button to see that the transactions have been processed.To interact with the contract, you can use the Truffle console. The Truffle console is similar to Truffle Develop, except it connects to an existing blockchain (in this case, the one generated by Ganache).truffle consoleYou will see the following prompt:truffle(development)>                Interacting with the contract      Interact with the contract using the console in the following ways:Note: We're using web3.eth.getAccounts() in these examples, which returns a promise which resolves to an array of all the accounts generated by the mnemonic. So, given the addresses generated by our mnemonic above, specifying (await web3.eth.getAccounts())[0] is equivalent to the address 0x627306090abab3a6e1400e9345bc60c78a8bef57.As of Truffle v5, the console supports async/await functions, enabling much simpler interactions with the contract.Begin by establishing both the deployed MetaCoin contract instance and the accounts created by either Truffle's built-in blockchain or Ganache:truffle(development)> let instance = await MetaCoin.deployed()truffle(development)> let accounts = await web3.eth.getAccounts()Check the metacoin balance of the account that deployed the contract:truffle(development)> let balance = await instance.getBalance(accounts[0])truffle(development)> balance.toNumber()See how much ether that balance is worth (and note that the contract defines a metacoin to be worth 2 ether):truffle(development)> let ether = await instance.getBalanceInEth(accounts[0])truffle(development)> ether.toNumber()Transfer some metacoin from one account to another:truffle(development)> instance.sendCoin(accounts[1], 500)Check the balance of the account that received the metacoin:truffle(development)> let received = await instance.getBalance(accounts[1])truffle(development)> received.toNumber()Check the balance of the account that sent the metacoin:truffle(development)> let newBalance = await instance.getBalance(accounts[0])truffle(development)> newBalance.toNumber()                Continue learning      This quickstart showed you the basics of the Truffle project lifecycle, but there is much more to learn. Please continue on with the rest of our documentation and especially our tutorials to learn more.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Build Processes","contents":"                          Build Processes      Alert: The build command and this approach is being deprecated. Please use third-party build tools like webpack or grunt, or see our Truffle Boxes for an example.In order to provide tight integration with Truffle for those that desire it, Truffle allows you to specify a custom build pipeline meant to bootstrap and configure your application. Truffle provides three methods of integration, described below.                Running an external command      If you'd like Truffle to run an external command whenever it triggers a build, simply include that option as a string within your project configuration, like so:module.exports = {  // This will run the `webpack` command on each build.  //  // The following environment variables will be set when running the command:  // WORKING_DIRECTORY: root location of the project  // BUILD_DESTINATION_DIRECTORY: expected destination of built assets (important for `truffle serve`)  // BUILD_CONTRACTS_DIRECTORY: root location of your build contract files (.sol.js)  //  build: \"webpack\"}Note that you're given ample environment variables with which to integrate with Truffle, detailed above.                Providing a custom function      You can also provide a custom build function like the one below. Note you're given a plethora of information about your project which you can use to integrate tightly with Truffle.module.exports = {  build: function(options, callback) {     // Do something when a build is required. `options` contains these values:     //     // working_directory: root location of the project     // contracts_directory: root directory of .sol files     // destination_directory: directory where truffle expects the built assets (important for `truffle serve`)  }}                Creating a custom module      You could also create a module or object that implements the builder interface (i.e., is an object which contains a build function like the one above). This is great for those who want to maintain tighter integration with Truffle and publish a package to make everyone else's lives easier.Here's an example using Truffle's default builder:var DefaultBuilder = require(\"truffle-default-builder\");module.exports = {  build: new DefaultBuilder(...) // specify the default builder configuration here.}                Bootstrapping your application      Whether you're building an application to run in the browser, or a command line tool, a Javascript library or a native mobile application, bootstrapping your contracts is the same, and using your deployed contract artifacts follows the same general process no matter the app you're building.When configuring your build tool or application, you'll need to perform the following steps:1) Get all your contract artifacts into your build pipeline / application. This includes all of the .json files within the ./build/contracts directory.2) Turn those .json contract artifacts into contract abstractions that are easy to use, via truffle-contract.3) Provision those contract abstractions with a Web3 provider. In the browser, this provider might come from Metamask or Mist, but it could also be a custom provider you've configured to point to Infura or any other Ethereum client.4) Use your contracts!In Node, this is very easy to do. Let's take a look at an example that shows off the \"purest\" way of performing the above steps, since it exists outside of any build process or tool.// Step 1: Get a contract into my applicationvar json = require(\"./build/contracts/MyContract.json\");// Step 2: Turn that contract into an abstraction I can usevar contract = require(\"truffle-contract\");var MyContract = contract(json);// Step 3: Provision the contract with a web3 providerMyContract.setProvider(new Web3.providers.HttpProvider(\"http://127.0.0.1:8545\"));// Step 4: Use the contract!MyContract.deployed().then(function(deployed) {  return deployed.someFunction();});All build processes and contract bootstrapping will follow this pattern. The key when setting up your own custom build process is to ensure you're consuming all of your contract artifacts and provisioning your abstractions correctly.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Truffle Boxes","contents":"                          Creating a Truffle Box                      Creating a box      To create a Truffle Box you'll need a few things:A GitHub repositoryA configuration fileOptionally, small and large images for the box's listingThe configuration file and images belong in the top-level directory of your repo. With these files in place, and your repo on GitHub, the unbox command will be: truffle unbox {USER_NAME || ORG_NAME}/{REPO_NAME}If you're starting from scratch, we've created a blueprint box containing a configuration file with common values, as well as template versions of the small and large images.If you're using an existing project, download the files here and extract them into your project.                Configuration file      All truffle boxes include a configuration file, truffle-box.json. This file has three attributes: ignore, commands, and hooks.                ignore (array)      An array of files or relative paths you'd like Truffle to ignore when unboxing. Common files include the readme.md or .gitignore. These files will not be copied over from the box's repo when you unbox.\"ignore\": [  \"README.md\",  \".gitignore\"]                commands (object)      An object who's key/value pairs are a descriptor and console command respectively. These pairs will be shown to users once your box is successfully unboxed. Think of these as quick instructions.For example, consider the object below. We've given our users all they need to compile, migrate and test their smart contracts, along with commands for developing the front-end.\"commands\": {  \"Compile\": \"truffle compile\",  \"Migrate\": \"truffle migrate\",  \"Test contracts\": \"truffle test\",  \"Test dapp\": \"npm test\",  \"Run dev server\": \"npm run start\",  \"Build for production\": \"npm run build\"}                hooks (object)      An object containing console commands to execute once unboxed. Since we're working in Node.js, most commonly this will contain npm install.\"hooks\": {  \"post-unpack\": \"npm install\"}                Images      The large box image is a 512px square with 32px of padding on each side.          The small box image is 735px x 100px. There is 32px of padding on the left side of the banner, and it's minimum size (described in the template as \"Min Banner Width\") is 290px, including the left padding. The banners are fixed to the left side and crop off the right side as the window narrows.          If no images are provided in a box, we default to banners containing the Truffle logo:                                    Truffle site listing      Before being listed on the Truffle website, all boxes undergo a screening process to ensure compatibility with Truffle. To start the pre-screening process, send us an email with your desired box name and brief description, along with a link to its GitHub repo to: info@trufflesuite.com.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Networks and App Deployment","contents":"                          Networks and App Deployment      Even the smallest project will interact with at the very least two blockchain nodes: One on the developer's machine, like Ganache or Truffle Develop, and the other representing the network where the developer will eventually deploy their application (such as the main public Ethereum network or a private consortium network, for instance). Truffle provides a system for managing the compilation and deployment artifacts for each network, and does so in a way that simplifies final application deployment.                Configuration      See the Configuration section for more information.                Specifying a network      Most Truffle commands will behave differently based on the network specified, and will use that network's contracts and configuration. You can specify a network using the --network option, like below:$ truffle migrate --network liveIn this example, Truffle will run your migrations on the \"live\" network, which -- if configured like the example -- is associated with the public Ethereum blockchain.                Build artifacts      As mentioned in the Compiling contracts section, build artifacts are stored in the ./build/contracts directory as .json files. When you compile your contracts or run your migrations using a specific network, Truffle will update those .json files so they contain the information related to that network. When those artifacts are used later -- such as within your frontend or application via truffle-contract -- they'll automatically detect which network the Ethereum client is connected to and use the correct contract artifacts accordingly.                Application deployment      Because the network is auto-detected by the contract artifacts at runtime, this means that you only need to deploy your application or frontend once. When you run your application, the running Ethereum client will determine which artifacts are used, and this will make your application very flexible. As an example, if you were to deploy a web application to http://mydapp.io, you could navigate to that address using your favorite wallet-browser (like MetaMask, or Mist) and your dapp would work correctly regardless of the Ethereum network the wallet-browser was connected to. If the wallet-browser was connected to the live network, your dapp would use the contracts you deployed on the live network. If on Ropsten, the contracts you deployed to Ropsten would be used.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Compiling Contracts","contents":"                          Compiling contracts                      Location      All of your contracts are located in your project's contracts/ directory. As contracts are written in Solidity, all files containing contracts will have a file extension of .sol. Associated Solidity libraries will also have a .sol extension.With a bare Truffle project (created through truffle init), you're given a single Migrations.sol file that helps in the deployment process. If you're using a Truffle Box, you will have multiple files here.                Command      To compile a Truffle project, change to the root of the directory where the project is located and then type the following into a terminal:truffle compileUpon first run, all contracts will be compiled. Upon subsequent runs, Truffle will compile only the contracts that have been changed since the last compile. If you'd like to override this behavior, run the above command with the --all option.                Build artifacts      Artifacts of your compilation will be placed in the build/contracts/ directory, relative to your project root. (This directory will be created if it does not exist.)These artifacts are integral to the inner workings of Truffle, and they play an important part in the successful deployment of your application. You should not edit these files as they'll be overwritten by contract compilation and deployment.                Dependencies      You can declare contract dependencies using Solidity's import command. Truffle will compile contracts in the correct order and ensure all dependencies are sent to the compiler. Dependencies can be specified in two ways:                Importing dependencies via file name      To import contracts from a separate file, add the following code to your Solidity source file:import \"./AnotherContract.sol\";This will make all contracts within AnotherContract.sol available. Here, AnotherContract.sol is relative to the path of the current contract being written.Note that Solidity allows other import syntaxes as well. See the Solidity import documentation for more information.                Importing contracts from an external package      Truffle supports dependencies installed via both EthPM and NPM. To import contracts from a dependency, use the following syntaximport \"somepackage/SomeContract.sol\";Here, somepackage represents a package installed via EthPM or NPM, and SomeContract.sol represents a Solidity source file provided by that package.Note that Truffle will search installed packages from EthPM first before searching for packages installed from NPM, so in the rare case of a naming conflict the package installed via EthPM will be used.For more information on how to use Truffle's package management features, please see the Truffle EthPM and NPM documentation.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Creating a Project","contents":"                          Creating a Project      To use most Truffle commands, you need to run them against an existing Truffle project. So the first step is to create a Truffle project.You can create a bare project template, but for those just getting started, you can use Truffle Boxes, which are example applications and project templates. We'll use the MetaCoin box, which creates a token that can be transferred between accounts:Create a new directory for your Truffle project:mkdir MetaCoincd MetaCoinDownload (\"unbox\") the MetaCoin box:truffle unbox metacoinNote: You can use the truffle unbox <box-name> command to download any of the other Truffle Boxes.Note: To create a bare Truffle project with no smart contracts included, use truffle init.Note: You can use an optional --force to initialize the project in the current directory regardless of its state (e.g. even if it contains other files or directories). This applies to both the init and unbox commands. Be careful, this will potentially overwrite files that exist in the directory.Once this operation is completed, you'll now have a project structure with the following items:contracts/: Directory for Solidity contractsmigrations/: Directory for scriptable deployment filestest/: Directory for test files for testing your application and contractstruffle.js: Truffle configuration file                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Debugging Your Contracts","contents":"                          Debugging Your Contracts      Truffle includes an integrated debugger so that you can debug transactions made against your contracts. This debugger looks and feels like existing command line debuggers available for traditional development environments.                Overview      Debugging a transaction on the blockchain is different than debugging traditional applications (for instance, applications written in C++ or Javascript). When debugging a transaction on the blockchain, you're not running the code in real-time; instead, you're stepping over the historical execution of that transaction, and mapping that execution onto its associated code. This gives us many liberties in debugging, in that we can debug any transaction, any time, so long as we have the code and artifacts for the contracts the transaction interacted with. Think of these code and artifacts as akin to the debugging symbols needed by traditional debuggers.In order to debug transactions, you'll need the following:Truffle 4.0 or above.The hash of a transaction on your desired blockchain.The source code and artifacts the transaction encounters.Note that it's okay if your desired transaction resulted in an exception or if it ran out of gas. The transaction still exists on chain, and so you can still debug it!                Command      To use the debugger, gather the transaction you'd like to debug then run the following:$ truffle debug <transaction hash>Using a transaction starting with 0x8e5dadfb921dd... as an example, the command would look as follows:$ truffle debug 0x8e5dadfb921ddddfa8f53af1f9bd8beeac6838d52d7e0c2fe5085b42a4f3ca76This will launch the debugging interface described below.                Debugging interface      Starting the debugger will open an interface familiar to those that have debugged other types of applications. When it starts, you'll see the following:A list of addresses either transacted against or created during the course of this transaction.A list of available commands for using the debugger.And the initial entry point for the transaction, including contract source file and code preview.The enter key is set to perform the last command entered. When the debugger starts, the enter key is set to step to the next logical source code element encountered during execution (i.e., the next expression or statement evaluated by the Ethereum virtual machine). At this point you can press enter to step through the transaction, or enter one of the available commands to analyze the transaction in more detail. The list of commands is detailed below.                (o) step over      This command steps over the current line, relative to the position of the statement or expression currently being evaluated in the Solidity source file. Use this command if you don't want to step into a function call or contract creation on the current line, or if you'd like to quickly jump to a specific point in the source file.                (i) step into      This command steps into the function call or contract creation currently being evaluated. Use this command to jump into the function and quickly start debugging the code that exists there.                (u) step out      This command steps out of the currently running function. Use this command to quickly get back to the calling function, or end execution of the transaction if this was the entry point of the transaction.                (n) step next      This command steps to the next logical statement or expression in the source code. For example, evaluating sub expressions will need to occur first before the virtual machine can evaluate the full expression. Use this command if you'd like to analyze each logical item the virtual machine evaluates.                (;) step instruction      This command allows you to step through each individual instruction evaluated by the virtual machine. This is useful if you're interested in understanding the low level bytecode created by the Solidity source code. When you use this command, the debugger will also print out the stack data at the time the instruction was evaluated.                (p) print instruction      This commands prints the current instruction and stack data, but does not step to the next instruction. Use this when you'd like to see the current instruction and stack data after navigating through the transaction with the logical commands described above.                (h) print this help      Print the list of available commands.                (q) quit      Quit the debugger.                (r) reset      Reset the debugger to the beginning of the transaction.                (b) set a breakpoint      This command allows you to set breakpoints for any line in any of your source files (see examples below).  These can be given by line number; by relative line number; by line number in a specified source file; or one may simply add a breakpoint at the current point in the code.                (B) remove a breakpoint      This command allows you to remove any of your existing breakpoints, with the same syntax as for adding them (see example below).  Type B all to remove all breakpoints.                (c) continue until breakpoint      This command will cause execution of the code to continue until the next breakpoint is reached or the last line is executed.                (+) add watch expression      This command will add a watch on a provided expression, based on the following syntax: +:<expression>.                (-) remove watch expression      This command will remove a watch expression, based on the following syntax: -:<expression>.                (?) list existing watch expressions      This command will display a list all the current watch expressions.                (v) display variables      This command will display the current variables and their values.  Not all types of data are supported yet.                Adding and removing breakpoints      Below are some examples of adding and removing breakpoints. Note the difference in case between adding (a lowercase 'b') and removing (an uppercase 'B').MagicSquare.sol:11:   event Generated(uint n);12:13:   function generateMagicSquare(uint n)      ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^debug(develop:0x91c817a1...)> b 23Breakpoint added at line 23.debug(develop:0x91c817a1...)> B 23Breakpoint removed at line 23.debug(develop:0x91c817a1...)> b SquareLib:5Breakpoint added at line 5 in SquareLib.sol.debug(develop:0x91c817a1...)> b +10Breakpoint added at line 23.debug(develop:0x91c817a1...)> bBreakpoint added at this point in line 13.debug(develop:0x91c817a1...)> B allRemoved all breakpoints.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Installation","contents":"                          Installation      npm install -g truffle                Requirements      NodeJS v8.9.4 or laterWindows, Linux or Mac OS XTruffle also requires that you have a running Ethereum client which supports the standard JSON RPC API (which is nearly all of them). There are many to choose from, and some better than others for development. We'll discuss them in detail in the Choosing an Ethereum client section.                Recommendations for Windows      If you're running Truffle on Windows, you may encounter some naming conflicts that could prevent Truffle from executing properly. Please see the section on resolving naming conflicts for solutions.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Interacting with Your Contracts","contents":"                          Interacting with your contracts                      Introduction      If you were writing raw requests to the Ethereum network yourself in order to interact with your contracts, you'd soon realize that writing these requests is clunky and cumbersome. As well, you might find that managing the state for each request you've made is complicated. Fortunately, Truffle takes care of this complexity for you, to make interacting with your contracts a breeze.                Reading and writing data      The Ethereum network makes a distinction between writing data to the network and reading data from it, and this distinction plays a significant part in how you write your application. In general, writing data is called a transaction whereas reading data is called a call. Transactions and calls are treated very differently, and have the following characteristics.                Transactions      Transactions fundamentally change the state of the network. A transaction can be as simple as sending Ether to another account, or as complicated as executing a contract function or adding a new contract to the network. The defining characteristic of a transaction is that it writes (or changes) data. Transactions cost Ether to run, known as \"gas\", and transactions take time to process. When you execute a contract's function via a transaction, you cannot receive that function's return value because the transaction isn't processed immediately. In general, functions meant to be executed via a transaction will not return a value; they will return a transaction id instead. So in summary, transactions:Cost gas (Ether)Change the state of the networkAren't processed immediatelyWon't expose a return value (only a transaction id).                Calls      Calls, on the other hand, are very different. Calls can be used to execute code on the network, though no data will be permanently changed. Calls are free to run, and their defining characteristic is that they read data. When you execute a contract function via a call you will receive the return value immediately. In summary, calls:Are free (do not cost gas)Do not change the state of the networkAre processed immediatelyWill expose a return value (hooray!)Choosing between a transaction and a call is as simple as deciding whether you want to read data, or write it.                Introducing abstractions      Contract abstractions are the bread and butter of interacting with Ethereum contracts from Javascript. In short, contract abstractions are wrapper code that makes interaction with your contracts easy, in a way that lets you forget about the many engines and gears executing under the hood. Truffle uses its own contract abstraction via the truffle-contract module, and it is this contract abstraction that's described below.In order to appreciate the usefulness of a contract abstraction, however, we first need a contract to talk about. We'll use the MetaCoin contract available to you through Truffle Boxes via truffle unbox metacoin.pragma solidity ^0.4.2;import \"./ConvertLib.sol\";// This is just a simple example of a coin-like contract.// It is not standards compatible and cannot be expected to talk to other// coin/token contracts. If you want to create a standards-compliant// token, see: https://github.com/ConsenSys/Tokens. Cheers!contract MetaCoin {    mapping (address => uint) balances;    event Transfer(address indexed _from, address indexed _to, uint256 _value);    function MetaCoin() {        balances[tx.origin] = 10000;    }    function sendCoin(address receiver, uint amount) returns(bool sufficient) {        if (balances[msg.sender] < amount) return false;        balances[msg.sender] -= amount;        balances[receiver] += amount;        Transfer(msg.sender, receiver, amount);        return true;    }    function getBalanceInEth(address addr) returns(uint){        return ConvertLib.convert(getBalance(addr),2);    }    function getBalance(address addr) returns(uint) {        return balances[addr];    }}This contract has three methods aside from the constructor (sendCoin, getBalanceInEth, and getBalance). All three methods can be executed as either a transaction or a call.Now let's look at the Javascript object called MetaCoin provided for us by Truffle, as made available in the Truffle console:truffle(develop)> let instance = await MetaCoin.deployed()truffle(develop)> instance// outputs://// Contract// - address: \"0xa9f441a487754e6b27ba044a5a8eb2eec77f6b92\"// - allEvents: ()// - getBalance: ()// - getBalanceInEth: ()// - sendCoin: ()// ...Notice that the abstraction contains the exact same functions that exist within our contract. It also contains an address which points to the deployed version of the MetaCoin contract.                Executing contract functions      Using the abstraction you can easily execute contract functions on the Ethereum network.                Making a transaction      There are three functions on the MetaCoin contract that we can execute. If you analyze each of them, you'll see that sendCoin is the only function that aims to make changes to the network. The goal of sendCoin is to \"send\" some Meta coins from one account to the next, and these changes should persist.When calling sendCoin, we'll execute it as a transaction. In the following example, we'll send 10 Meta coin from one account to another, in a way that persists changes on the network:truffle(develop)> let accounts = await web3.eth.getAccounts()truffle(develop)> instance.sendCoin(accounts[1], 10, {from: accounts[0]})There are a few things interesting about the above code:We called the abstraction's sendCoin function directly. This will result in a transaction by default (i.e, writing data) instead of call.We passed an object as the third parameter to sendCoin. Note that the sendCoin function in our Solidity contract doesn't have a third parameter. What you see above is a special object that can always be passed as the last parameter to a function that lets you edit specific details about the transaction. Here, we set the from address ensuring this transaction came from accounts[0].                Making a call      Continuing with MetaCoin, notice the getBalance function is a great candidate for reading data from the network. It doesn't need to make any changes, as it just returns the MetaCoin balance of the address passed to it. Let's give it a shot:truffle(develop)> let balance = await instance.getBalance(accounts[0])truffle(develop)> balance.toNumber()What's interesting here:We received a return value. Note that since the Ethereum network can handle very large numbers, we're given a BigNumber object which we then convert to a number.Warning: We convert the return value to a number because in this example the numbers are small. However, if you try to convert a BigNumber that's larger than the largest integer supported by Javascript, you'll likely run into errors or unexpected behavior.                Processing transaction results      When you make a transaction, you're given a result object that gives you a wealth of information about the transaction.truffle(develop)> let result = await contract.sendCoin(accounts[1], 10, {from: accounts[0]})truffle(develop)> resultSpecifically, you get the following:result.tx (string) - Transaction hashresult.logs (array) - Decoded events (logs)result.receipt (object) - Transaction receipt (includes the amount of gas used)For more information, please see the README in the truffle-contract package.                Catching events      Your contracts can fire events that you can catch to gain more insight into what your contracts are doing. The easiest way to handle events is by processing the logs array contained within result object of the transaction that triggered the event.If we explicitly output the first log entry we can see the details of the event that was emitted as part of the sendCoin call (Transfer(msg.sender, receiver, amount);).truffle(develop)> result.logs[0]{ logIndex: 0,  transactionIndex: 0,  transactionHash: '0x3b33960e99416f687b983d4a6bb628d38bf7855c6249e71d0d16c7930a588cb2',  blockHash: '0xe36787063e114a763469e7dabc7aa57545e67eb2c395a1e6784988ac065fdd59',  blockNumber: 8,  address: '0x6891Ac4E2EF3dA9bc88C96fEDbC9eA4d6D88F768',  type: 'mined',  id: 'log_3181e274',  event: 'Transfer',  args:   Result {     '0': '0x8128880DC48cde7e471EF6b99d3877357bb93f01',     '1': '0x12B6971f6eb35dD138a03Bd6cBdf9Fc9b9a87d7e',     '2': <BN: a>,     __length__: 3,     _from: '0x8128880DC48cde7e471EF6b99d3877357bb93f01',     _to: '0x12B6971f6eb35dD138a03Bd6cBdf9Fc9b9a87d7e',     _value: <BN: a> } }                Add a new contract to the network      In all of the above cases, we've been using a contract abstraction that has already been deployed. We can deploy our own version to the network using the .new() function:truffle(develop)> let newInstance = await MetaCoin.new()truffle(develop)> newInstance.address'0x64307b67314b584b1E3Be606255bd683C835A876'                Use a contract at a specific address      If you already have an address for a contract, you can create a new abstraction to represent the contract at that address.let specificInstance = await MetaCoin.at(\"0x1234...\");                Sending ether to a contract      You may simply want to send Ether directly to a contract, or trigger a contract's fallback function. You can do so using one of the following two options.Option 1: Send a transaction directly to a contract via instance.sendTransaction(). This is promisified like all available contract instance functions, and has the same API as web3.eth.sendTransaction but without the callback. The to value will be automatically filled in for you if not specified.instance.sendTransaction({...}).then(function(result) {  // Same transaction result object as above.});Option 2: There's also shorthand for just sending Ether directly:instance.send(web3.toWei(1, \"ether\")).then(function(result) {  // Same result object as above.});                Further reading      The contract abstractions provided by Truffle contain a wealth of utilities for making interacting with your contracts easy. Check out the truffle-contract documentation for tips, tricks and insights.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Package Management via EthPM","contents":"                          Package Management via EthPM      EthPM is the new Package Registry for Ethereum. It follows the ERC190 spec for publishing and consuming smart contract packages, and has gained wide support from many diverse Ethereum development tools. To show our support, we've integrated the Ethereum Package Registry directly into Truffle.                Installing a package      Installing a package from EthPM is nearly as easy as installing a package via NPM. You can simply run the following command:$ truffle install <package name>You can also install a package at a specific version:$ truffle install <package name>@<version>Like NPM, EthPM versions follow semver. You can find a list of all available packages at the Ethereum Package Registry.                Installing Dependencies      Your project can define an ethpm.json file that among other things can pin your project to specific dependencies and versions. To install all dependencies listed in the ethpm.json file, run:$ truffle installFor more details on the ethpm.json file, see the package configuration below.                Consuming installed contracts      Installed packages will be placed in the installed_contracts directory within your project folder. If no installed_contracts directory exists it'll be created for you. You should treat this folder like you treat the node_modules folder with NPM -- that is, you shouldn't edit the contents inside unless you know what you're doing. :)Installed packages can be consumed within your tests, migrations and solidity contract files by import'ing or require'ing that package and contract by name. For example, the following Solidity contract would import the owned.sol file from the owned package:pragma solidity ^0.4.2;import \"owned/owned.sol\";contract MyContract is owned {  // ...}Similarly, the following migration file would use the ENS.sol contract from the ens package:File: ./migrations/2_deploy_contracts.jsvar ENS = artifacts.require(\"ens/ENS\");var MyContract = artifacts.require(\"MyContract\");module.exports = function(deployer) {  // Only deploy ENS if there's not already an address already.  // i.e., don't deploy if we're using the canonical ENS address,  // but do deploy it if we're on a test network and ENS doesn't exist.  deployer.deploy(ENS, {overwrite: false}).then(function() {    return deployer.deploy(MyContract, ENS.address);  });};Note that in the migration above, we consume the ens package and deploy the ENS contract conditionally based on whether or not ENS already has an address set. This is a fancy trick provided to you by the deployer that makes it much easier to write migrations dependent on the the existence of network artifacts. In this case, if we were running our migrations on the Ropsten network, this migration wouldn't deploy the ENS contract because (at the time of this writing) Ropsten is where the canonical ENS contract exists -- we wouldn't want to deploy our own. But if we were running our migrations against a different network, or a test network perhaps, then we'd want to deploy the ENS contract so that we have a dependency contract to work with.                Publishing your own package      Publishing your own package is as straightforward as installing, but like NPM, requires a bit more configuration.                Ropsten, Ropsten, Ropsten      The Ethereum Package Registry currently exists on the Ropsten test network. To publish to the registry, we need to set up our own Ropsten configuration because we'll be making transactions that need to be signed.In this example, we'll use Infura for publishing packages along with the truffle-hdwallet-provider NPM module and a 12-word hd-wallet mnemonic that represents our Ethereum address on the Ropsten network. First, install the truffle-hdwallet-provider via NPM within your project directory:$ npm install truffle-hdwallet-provider --saveThen edit your configuration to add the ropsten network using your 12-word mnemonic:File: truffle.jsvar HDWalletProvider = require(\"truffle-hdwallet-provider\");// 12-word mnemonicvar mnemonic = \"opinion destroy betray ...\";module.exports = {  networks: {    development: {      host: \"127.0.0.1\",      port: 8545,      network_id: \"*\" // Match any network id    },    ropsten: {      provider: new HDWalletProvider(mnemonic, \"https://ropsten.infura.io/\"),      network_id: 3 // official id of the ropsten network    }  }};                Package configuration      Like NPM, configuration options for EthPM go in a separate JSON file called ethpm.json. This file sits alongside your Truffle configuration and gives Truffle all the information it needs to publish your package. You can see a full list of available options in the Configuration section.File: ethpm.json{  \"package_name\": \"adder\",  \"version\": \"0.0.3\",  \"description\": \"Simple contract to add two numbers\",  \"authors\": [    \"Tim Coulter <tim.coulter@consensys.net>\"  ],  \"keywords\": [    \"ethereum\",    \"addition\"  ],  \"dependencies\": {    \"owned\": \"^0.0.1\"  },  \"license\": \"MIT\"}                Command      After you have your configuration settled, publishing is a snap:$ truffle publishYou'll see output similar to that below, with confirmation that your package was published successfully.$ truffle publishGathering contracts...Finding publishable artifacts...Uploading sources and publishing to registry...+ adder@0.0.3                Before publishing      When using a network like the default develop network that's configured to match any Ethereum client (like Ganache or Truffle Develop), you're bound to have network artifacts lying around that you don't want published. Before publishing your package, consider running the following command to remove any extraneous network artifacts:$ truffle networks --cleanSee the command reference for more information.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Package Management via NPM","contents":"                          Package Management via NPM      Truffle comes standard with npm integration, and is aware of the node_modules directory in your project if it exists. This means you can use and distribute contracts, dapps and Ethereum-enabled libraries via npm, making your code available to others and other's code available to you.                Package layout      Projects created with Truffle have a specific layout by default which enables them to be used as packages. This layout isn't required, but if used as a common convention -- or \"de-facto standard\" -- then distributing contracts and dapps through NPM will become much easier.The most important directories in a Truffle package are the following:/contracts/build (which includes /build/contracts, created by Truffle)The first directory is your contracts directory, which includes your raw Solidity contracts. The second directory is the build directory, and more specifically /build/contracts, which holds build artifacts in the form of .json files. Including raw contracts in your package will allow others to import those contracts within their own solidity code. Similarly, including your .json build artifacts in your package will allow others to seamlessly interact with your contracts from JavaScript, which can be used in dapps, scripts and migrations.                Using a package      When using a package within your own project, it is important to note that there are two places where you might be interested in using other's contract code: within your contracts and within your Javascript code (migrations and tests). The following provides an example of each case, and discusses techniques for making the most of other's contracts and build artifacts.                Installing      For this example, we're going to use the Example Truffle Library, which provides a simple name registry that is deployed to the Morden test network. In order to use it as a dependency, we must first install it within our project through npm:$ cd my_project$ npm install example-truffle-libraryNote that the last command above downloads the package and places it in my_project/node_modules directory, which is important for the examples below. See the npm documentation for help using npm to install packages.                Within your contracts      To use a package's contracts within your contracts, this can be as simple as Solidity's import statement. When your import path isn't explicitly relative or absolute, this signifies to Truffle that you're looking for a file from a specific named package. Consider this example using the Example Truffle Library mentioned above:import \"example-truffle-library/contracts/SimpleNameRegistry.sol\";Since the path didn't start with ./, Truffle knows to look in your project's node_modules directory for the example-truffle-library folder. From there, it resolves the path to provide you the contract you requested.                Within JavaScript code      To interact with package's contracts within JavaScript code, you simply need to require that package's .json files, and then use the truffle-contract module to turn those into usable abstractions:var contract = require(\"truffle-contract\");var data = require(\"example-truffle-library/build/contracts/SimpleNameRegistry.json\");var SimpleNameRegistry = contract(data);To use these abstractions, see the Interacting With Your Contracts section for more details.                Package's deployed addresses      Sometimes you want your contracts to interact with the package's previously deployed contracts. Since the deployed addresses exist within the package's .json files, you must perform an extra step to get those addresses into your contracts. To do so, make your contract accept the address of the dependency contract, and then use migrations. The following is an example contract that exists within your project as well as an example migration:Contract: MyContract.solpragma solidity ^0.4.13;import \"example-truffle-library/contracts/SimpleNameRegistry.sol\";contract MyContract {  SimpleNameRegistry registry;  address public owner;  function MyContract {    owner = msg.sender;  }  // Simple example that uses the deployed registry from the package.  function getModule(bytes32 name) returns (address) {    return registry.names(name);  }  // Set the registry if you're the owner.  function setRegistry(address addr) {    require(msg.sender == owner);    registry = SimpleNameRegistry(addr);  }}Migration: 3_hook_up_example_library.js// Note that artifacts.require takes care of creating an abstraction for us.var SimpleNameRegistry = artifacts.require(\"example-truffle-library/SimpleNameRegistry\");module.exports = function(deployer) {  // Deploy our contract, then set the address of the registry.  deployer.deploy(MyContract).then(function() {    return MyContract.deployed();  }).then(function(deployed) {    return deployed.setRegistry(SimpleNameRegistry.address);  });};                Before publishing      When using a network like the default develop network that's configured to match any Ethereum client (like Ganache or Truffle Develop), you're bound to have network artifacts lying around that you don't want published. Before publishing your package, consider running the following command to remove any extraneous network artifacts:$ truffle networks --cleanSee the command reference for more information.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Running Migrations","contents":"                          Running Migrations      Migrations are JavaScript files that help you deploy contracts to the Ethereum network. These files are responsible for staging your deployment tasks, and they're written under the assumption that your deployment needs will change over time. As your project evolves, you'll create new migration scripts to further this evolution on the blockchain. A history of previously run migrations is recorded on-chain through a special Migrations contract, detailed below.                Command      To run your migrations, run the following:$ truffle migrateThis will run all migrations located within your project's migrations directory. At their simplest, migrations are simply a set of managed deployment scripts. If your migrations were previously run successfully, truffle migrate will start execution from the last migration that was run, running only newly created migrations. If no new migrations exists, truffle migrate won't perform any action at all. You can use the --reset option to run all your migrations from the beginning. For local testing make sure to have a test blockchain such as Ganache installed and running before executing migrate.                Migration files      A simple migration file looks like this:Filename: 4_example_migration.jsvar MyContract = artifacts.require(\"MyContract\");module.exports = function(deployer) {  // deployment steps  deployer.deploy(MyContract);};Note that the filename is prefixed with a number and is suffixed by a description. The numbered prefix is required in order to record whether the migration ran successfully. The suffix is purely for human readability and comprehension.                artifacts.require()      At the beginning of the migration, we tell Truffle which contracts we'd like to interact with via the artifacts.require() method. This method is similar to Node's require, but in our case it specifically returns a contract abstraction that we can use within the rest of our deployment script. The name specified should match the name of the contract definition within that source file. Do not pass the name of the source file, as files can contain more than one contract.Consider this example where two contracts are specified within the same source file:Filename: ./contracts/Contracts.solcontract ContractOne {  // ...}contract ContractTwo {  // ...}To use only ContractTwo, your artifacts.require() statement would look like this:var ContractTwo = artifacts.require(\"ContractTwo\");To use both contracts, you will need two artifacts.require() statements:var ContractOne = artifacts.require(\"ContractOne\");var ContractTwo = artifacts.require(\"ContractTwo\");                module.exports      All migrations must export a function via the module.exports syntax. The function exported by each migration should accept a deployer object as its first parameter. This object aides in deployment by both providing a clear syntax for deploying smart contracts as well as performing some of deployment's more mundane duties, such as saving deployed artifacts for later use. The deployer object is your main interface for staging deployment tasks, and its API is described at the bottom of this page.Your migration function can accept other parameters as well. See the examples below.                Initial migration      Truffle requires you to have a Migrations contract in order to use the Migrations feature. This contract must contain a specific interface, but you're free to edit this contract at will. For most projects, this contract will be deployed initially as the first migration and won't be updated again. You will also receive this contract by default when creating a new project with truffle init.Filename: contracts/Migrations.solpragma solidity ^0.4.8;contract Migrations {  address public owner;  // A function with the signature `last_completed_migration()`, returning a uint, is required.  uint public last_completed_migration;  modifier restricted() {    if (msg.sender == owner) _;  }  function Migrations() {    owner = msg.sender;  }  // A function with the signature `setCompleted(uint)` is required.  function setCompleted(uint completed) restricted {    last_completed_migration = completed;  }  function upgrade(address new_address) restricted {    Migrations upgraded = Migrations(new_address);    upgraded.setCompleted(last_completed_migration);  }}You must deploy this contract inside your first migration in order to take advantage of the Migrations feature. To do so, create the following migration:Filename: migrations/1_initial_migration.jsvar Migrations = artifacts.require(\"Migrations\");module.exports = function(deployer) {  // Deploy the Migrations contract as our only task  deployer.deploy(Migrations);};From here, you can create new migrations with increasing numbered prefixes to deploy other contracts and perform further deployment steps.                Deployer      Your migration files will use the deployer to stage deployment tasks. As such, you can write deployment tasks synchronously and they'll be executed in the correct order:// Stage deploying A before Bdeployer.deploy(A);deployer.deploy(B);Alternatively, each function on the deployer can be used as a Promise, to queue up deployment tasks that depend on the execution of the previous task:// Deploy A, then deploy B, passing in A's newly deployed addressdeployer.deploy(A).then(function() {  return deployer.deploy(B, A.address);});It is possible to write your deployment as a single promise chain if you find that syntax to be more clear. The deployer API is discussed at the bottom of this page.                Network considerations      It is possible to run deployment steps conditionally based on the network being deployed to. This is an advanced feature, so see the Networks section first before continuing.To conditionally stage deployment steps, write your migrations so that they accept a second parameter, called network. Example:module.exports = function(deployer, network) {  if (network == \"live\") {    // Do something specific to the network named \"live\".  } else {    // Perform a different step otherwise.  }}                Available accounts      Migrations are also passed the list of accounts provided to you by your Ethereum client and web3 provider, for you to use during your deployments. This is the exact same list of accounts returned from web3.eth.getAccounts().module.exports = function(deployer, network, accounts) {  // Use the accounts within your migrations.}                Deployer API      The deployer contains many functions available to simplify your migrations.                deployer.deploy(contract, args..., options)      Deploy a specific contract, specified by the contract object, with optional constructor arguments. This is useful for singleton contracts, such that only one instance of this contract exists for your dapp. This will set the address of the contract after deployment (i.e., Contract.address will equal the newly deployed address), and it will override any previous address stored.You can optionally pass an array of contracts, or an array of arrays, to speed up deployment of multiple contracts. Additionally, the last argument is an optional object that can include the key named overwrite as well as other transaction parameters such as gas and from. If overwrite is set to false, the deployer won't deploy this contract if one has already been deployed. This is useful for certain circumstances where a contract address is provided by an external dependency.Note that you will need to deploy and link any libraries your contracts depend on first before calling deploy. See the link function below for more details.For more information, please see the truffle-contract documentation.Examples:// Deploy a single contract without constructor argumentsdeployer.deploy(A);// Deploy a single contract with constructor argumentsdeployer.deploy(A, arg1, arg2, ...);// Don't deploy this contract if it has already been deployeddeployer.deploy(A, {overwrite: false});// Set a maximum amount of gas and `from` address for the deploymentdeployer.deploy(A, {gas: 4612388, from: \"0x....\"});// Deploy multiple contracts, some with arguments and some without.// This is quicker than writing three `deployer.deploy()` statements as the deployer// can perform the deployment as a single batched request.deployer.deploy([  [A, arg1, arg2, ...],  B,  [C, arg1]]);// External dependency example://// For this example, our dependency provides an address when we're deploying to the// live network, but not for any other networks like testing and development.// When we're deploying to the live network we want it to use that address, but in// testing and development we need to deploy a version of our own. Instead of writing// a bunch of conditionals, we can simply use the `overwrite` key.deployer.deploy(SomeDependency, {overwrite: false});                deployer.link(library, destinations)      Link an already-deployed library to a contract or multiple contracts. destinations can be a single contract or an array of multiple contracts. If any contract within the destination doesn't rely on the library being linked, the contract will be ignored.Example:// Deploy library LibA, then link LibA to contract B, then deploy B.deployer.deploy(LibA);deployer.link(LibA, B);deployer.deploy(B);// Link LibA to many contractsdeployer.link(LibA, [B, C, D]);                deployer.then(function() {...})      Just like a promise, run an arbitrary deployment step. Use this to call specific contract functions during your migration to add, edit and reorganize contract data.Example:var a, b;deployer.then(function() {  // Create a new version of A  return A.new();}).then(function(instance) {  a = instance;  // Get the deployed instance of B  return B.deployed();}).then(function(instance) {  b = instance;  // Set the new instance of A's address on B via B's setA() function.  return b.setA(a.address);});                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Truffle and MetaMask","contents":"                          Truffle and MetaMask      Before you can interact with smart contracts in a browser, make sure they're compiled, deployed, and that you're interacting with them via web3 in client-side JavaScript. We recommend using the truffle-contract library, as it makes interacting with contracts easier and more robust.Note: For more information on these topics, including using truffle-contract, check out our Pet Shop or TutorialToken tutorials.Once you've done the above, you're ready to use MetaMask.                What is MetaMask?      MetaMask is the easiest way to interact with dapps in a browser. It is an extension for Chrome or Firefox that connects to an Ethereum network without running a full node on the browser's machine. It can connect to the main Ethereum network, any of the testnets (Ropsten, Kovan, and Rinkeby), or a local blockchain such as the one created by Ganache or Truffle Develop.          For development with Truffle this means we can use our dapp the same way users will interact with it on a live network.                Installing MetaMask      To install MetaMask for Chrome, go to the Chrome Web Store and click the Add to Chrome button.To install MetaMask for FireFox, go to the Firefox Add-ons page and click the Add to Firefox button.With our front-end ready to be used and MetaMask installed, we're ready to see our dapp in all its glory.                Using MetaMask with Ganache      Ganache is a graphical application that runs a blockchain that can be used for testing purposes. It runs on 127.0.0.1:7545.Note: We recommend specifying 127.0.0.1 instead of localhost because the address does not require a network connection and so is more suitable for development.                Detecting MetaMask's web3 injection      Before diving in, we'll need to make sure the dapp is checking for MetaMask's web3 instance and that the extension itself is configured properly with Ganache.MetaMask injects its own web3 instance, so we'll want to make sure we're checking for that. After the window has loaded perform the following check:// Is there is an injected web3 instance?if (typeof web3 !== 'undefined') {  App.web3Provider = web3.currentProvider;  web3 = new Web3(web3.currentProvider);} else {  // If no injected web3 instance is detected, fallback to Ganache.  App.web3Provider = new web3.providers.HttpProvider('http://127.0.0.1:7545');  web3 = new Web3(App.web3Provider);}                Setting up MetaMask      To use Ganache with MetaMask, click the MetaMask icon in your browser and this screen will appear:          MetaMask initial screenClick Import with seed phrase. In the box marked Wallet Seed, enter the mnemonic that was displayed when launching Ganache.Warning: Do not use this mnemonic on the main Ethereum network (mainnet). Make sure that you set the network to \"Private Network\" (use the \"Custom RPC\" setting). See below for details.Enter a password below that and click OK.          MetaMask seed phraseNow we need to connect MetaMask to the blockchain created by Ganache. Click the menu that shows \"Main Network\" and select Custom RPC.          MetaMask network menuIn the box titled \"New RPC URL\" (to the right of \"New Network\") enter http://127.0.0.1:7545 and click Save.The network name at the top will switch to say \"Private Network\". Click the cross in the top-right of the current window close out of the page and return to the Accounts page.Now that we've connected MetaMask to Ganache, you'll be taken to the accounts screen. Each account created by Ganache is given 100 ether. The first account should have less than the others because that account supplies the gas for smart contract deployment. Since you've deployed your smart contract to the network, this account paid for it.Click the account icon in the upper-right to create new accounts, the first 10 of which will correspond to the 10 accounts displayed when you launched Ganache.          MetaMask account                Using MetaMask with Truffle Develop      Truffle Develop is a command-line application that runs a temporary blockchain that is also used for testing purposes. It runs on 127.0.0.1:9545.Note: We recommend specifying 127.0.0.1 instead of localhost because the address does not require a network connection and so is more suitable for development.Using MetaMask with Truffle Develop is very similar to that of Ganache. The only difference is that Truffle Develop runs by default on 127.0.0.1:9545, so you'll want to edit the above web3 code to say:  // Is there is an injected web3 instance?  if (typeof web3 !== 'undefined') {    App.web3Provider = web3.currentProvider;    web3 = new Web3(web3.currentProvider);  } else {    // If no injected web3 instance is detected, fallback to Truffle Develop.    App.web3Provider = new web3.providers.HttpProvider('http://127.0.0.1:9545');    web3 = new Web3(App.web3Provider);  }In MetaMask, when entering the \"New RPC URL\", enter http://127.0.0.1:9545.                Using MetaMask with Ganache CLI      Using MetaMask with Ganache CLI is also very similar to that of Ganache. The only difference is that Ganache CLI runs by default on http://127.0.0.1:8545 so you'll want to edit the above web3 code to say:  // Is there is an injected web3 instance?  if (typeof web3 !== 'undefined') {    App.web3Provider = web3.currentProvider;    web3 = new Web3(web3.currentProvider);  } else {    // If no injected web3 instance is detected, fallback to Ganache CLI.    App.web3Provider = new web3.providers.HttpProvider('http://127.0.0.1:8545');    web3 = new Web3(App.web3Provider);  }In MetaMask, when entering the \"New RPC URL\", enter http://127.0.0.1:8545.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Using the Build Pipeline","contents":"                          Using the Build Pipeline      Alert: This command is deprecated. Please use third-party build tools like webpack or grunt, or see our Truffle Boxes for an example.Truffle 1.0 and 2.0 came standard with a default build system heavily geared toward web applications (here, the term \"build\" means turning code artifacts into HTML, Javascript and CSS). That build system has been pulled out into its own module to make Truffle usable and extensible for all kinds of applications.Truffle can be configured for tight integration with any build system. To configure a custom build system, see the Advanced Build Processes section for more details.                Command      To build your application when a build system is configured, run:$ truffle buildNote you'll receive an error if you try to run the build command without first configuring a custom build process.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Using Truffle Develop and the Console","contents":"                          Using Truffle Develop and the Console      Sometimes it's nice to work with your contracts interactively for testing and debugging purposes, or for executing transactions by hand. Truffle provides you two easy ways to do this via an interactive console, with your contracts available and ready to use.Truffle console: A basic interactive console connecting to any Ethereum clientTruffle Develop: An interactive console that also spawns a development blockchain                Why two different consoles?      Having two different consoles allows you to choose the best tool for your needs.Reasons to use Truffle console:You have a client you're already using, such as Ganache or gethYou want to migrate to a testnet (or the main Ethereum network)You want to use a specific mnemonic or account listReasons to use Truffle Develop:You are testing your project with no intention of immediately deployingYou don't need to work with specific accounts (and you're fine with using default development accounts)You don't want to install and manage a separate blockchain client                Commands      All commands require that you be in your project folder. You do not need to be at the root.                Console      To launch the console:truffle consoleThis will look for a network definition called development in the configuration, and connect to it, if available. You can override this using the --network <name> option. See more details in the Networks section as well as the command reference.When you load the console, you'll immediately see the following prompt:truffle(development)>This tells you you're running within a Truffle console using the development network.                Truffle Develop      To launch Truffle Develop:truffle developThis will spawn a development blockchain locally on port 9545, regardless of what your truffle-config.js configuration file calls for. If you already have a truffe develop session running, it will instead connect to that development blockchain.When you load Truffle Develop, you will see the following:Truffle Develop started at http://localhost:9545/Accounts:(0) 0x627306090abab3a6e1400e9345bc60c78a8bef57(1) 0xf17f52151ebef6c7334fad080c5704d77216b732(2) 0xc5fdf4076b8f3a5357c5e395ab970b5b54098fef(3) 0x821aea9a577a9b44299b9c15c88cf3087f3b5544(4) 0x0d1d4e623d10f9fba5db95830f7d3839406c6af2(5) 0x2932b7a2355d6fecc4b5c0b6bd44cc31df247a2e(6) 0x2191ef87e392377ec08e7c08eb105ef5448eced5(7) 0x0f4f2ac550a1b4e2280d04c21cea7ebd822934b5(8) 0x6330a553fc93768f612722bb8c2ec78ac90b3bbc(9) 0x5aeda56215b167893e80b4fe645ba6d5bab767dePrivate Keys:(0) c87509a1c067bbde78beb793e6fa76530b6382a4c0241e5e4a9ec0a0f44dc0d3(1) ae6ae8e5ccbfb04590405997ee2d52d2b330726137b875053c36d94e974d162f(2) 0dbbe8e4ae425a6d2687f1a7e3ba17bc98c673636790f1b8ad91193c05875ef1(3) c88b703fb08cbea894b6aeff5a544fb92e78a18e19814cd85da83b71f772aa6c(4) 388c684f0ba1ef5017716adb5d21a053ea8e90277d0868337519f97bede61418(5) 659cbb0e2411a44db63778987b1e22153c086a95eb6b18bdf89de078917abc63(6) 82d052c865f5763aad42add438569276c00d3d88a2d062d36b2bae914d58b8c8(7) aa3680d5d48a8283413f7a108367c7299ca73f553735860a87b08f39395618b7(8) 0f62d96d6675f32685bbdb8ac13cda7c23436f63efbb9d07700d8669ff12b7c4(9) 8d5366123cb560bb606379f90a0bfd4769eecc0557f1b362dcae9012b548b1e5Mnemonic: candy maple cake sugar pudding cream honey rich smooth crumble sweet treatThis shows you the addresses, private keys, and mnemonic for this particular blockchain.Note: When you run truffle develop for the first time, Truffle will generate a random mnemonic that will persist for you and you alone. If you want to use a different mnemonic or set of addresses, we recommend using Ganache.Warning: Remember to never use any of these addresses or the mnemonic on the mainnet. This is for development only.                Configuring Truffle Develop      You can configure truffle develop to use any of the availableganache-core options.For example:module.exports = {  /* ... rest of config */  networks: {    /* ... other networks */    develop: {      accounts: 5,      defaultEtherBalance: 500,      blockTime: 3    }  }};                Features      Both Truffle Develop and the console provide most of the features available in the Truffle command line tool. For instance, you can type migrate --reset within the console, and it will be interpreted the same as if you ran truffle migrate --reset on the command line.Additionally, both Truffle Develop and the console have the following features:All of your compiled contracts are available and ready for use.After each command (such as migrate --reset) your contracts are reprovisioned so you can start using the newly assigned addresses and binaries immediately.The web3 library is made available and is set to connect to your Ethereum client.                Commands available      buildcompilecreatedebugdeployexechelpinstallmigratenetworksopcodepublishruntestversionIf a Truffle command is not available, it is because it is not relevant for an existing project (for example, init) or wouldn't make sense (for example, develop or console).See full command reference for more information.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Writing External Scripts / Command Plugins","contents":"                          Writing External Scripts      Often you may want to run external scripts that interact with your contracts. Truffle provides an easy way to do this, bootstrapping your contracts based on your desired network and connecting to your Ethereum client automatically per your project configuration.                Command      To run an external script, perform the following:$ truffle exec <path/to/file.js>                File structure      In order for external scripts to be run correctly, Truffle expects them to export a function that takes a single parameter as a callback:module.exports = function(callback) {  // perform actions}You can do anything you'd like within this script, so long as the callback is called when the script finishes. The callback accepts an error as its first and only parameter. If an error is provided, execution will halt and the process will return a non-zero exit code.                Third-party plugin commands      Note: This feature is new and still in a barebones state. Please let usknow how we can improve it!                Plugin installation / usage      Install the plugin from NPM.npm install --save-dev truffle-plugin-helloAdd a plugins section to your Truffle config.module.exports = {  /* ... rest of truffle-config */  plugins: [    \"truffle-plugin-hello\"  ]}Run the command$ truffle run helloHello, World!                Creating a custom command plugin      Implement the command as a Node module with a function as its default export.Example: hello.js/** * Outputs `Hello, World!` when running `truffle run hello`, * or `Hello, ${name}` when running `truffle run hello [name]` * @param {Config} config - A truffle-config object. * Has attributes like `truffle_directory`, `working_directory`, etc. */ module.exports = async (config) => {  // config._ has the command arguments.  // config_[0] is the command name, e.g. \"hello\" here.  // config_[1] starts remaining parameters.  if (config.help) { console.log(`Usage: truffle run hello [name]`);     done(null, [], []);     return;  }  let name = config._.length > 1 ? config._[1] : 'World!';  console.log(`Hello, ${name}`);}Define a truffle-plugin.json file to specify the command.Example: truffle-plugin.json{  \"commands\": {\"hello\": \"hello.js\"  }}Publish to NPMnpm publish                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Choosing an Ethereum Client","contents":"                          Choosing an Ethereum client      There are many Ethereum clients to choose from. We recommend different clients depending on whether you are developing or deploying.                When developing                      Ganache      We recommend Ganache, a personal blockchain for Ethereum development that runs on your desktop. Part of the Truffle Suite, Ganache simplifies dapp development by placing your contracts and transactions front and center. Using Ganache you can quickly see how your application affects the blockchain, and introspect details like your accounts, balances, contract creations and gas costs. You can also fine tune Ganache's advanced mining controls to better suit your needs. Ganache is available for Windows, Mac and Linux, and you can download it here.Ganache, when launched, runs on http://127.0.0.1:7545. It will display the first 10 accounts and the mnemonic used to create those accounts. (Read more about account mnemonics.) The mnemonic will persist across restarts of Ganache, though it can be changed to be randomly generated. You can also input your own.Warning: Do not use this mnemonic on the main Ethereum network (mainnet).                Truffle Develop      We also recommend using Truffle Develop, a development blockchain built directly into Truffle. Truffle Develop helps you set up an integrated blockchain environment with a single command, no installation required. Run Truffle Develop by typing the following into a terminal:truffle developThis will run the client on http://127.0.0.1:9545. It will display the first 10 accounts and the mnemonic used to create those accounts. (Read more about account mnemonics.) When you run truffle develop for the first time it will generate a random mnemonic that will persist for you and you alone.Warning: Do not use this mnemonic on the main Ethereum network (mainnet). If you send ETH to any account generated from this mnemonic, you will lose it all!Once launched, Truffle Develop will provide you with a console you can use to run all available Truffle commands. These commands are input by omitting the truffle prefix. So, for example, to compile your smart contracts, instead of typing truffle compile, you need to only type compile.To read more about interacting with the console, please see the Using the Console section.                Ganache CLI      Ganache also has a command-line interface for those who aren't working from a graphical environment. Great for automated testing and continuous integration environments, Ganache CLI runs headless and can be configured to serve all your development needs. Ganache CLI processes transactions instantly instead of waiting for the default block time, so you can test that your code works quickly. It also tells you immediately when your smart contracts run into errors, and integrates directly with Truffle to reduce test runtime up to 90% compared to other clients. Learn more about Ganache CLI.                Deploying to live networks      There are many official and unofficial Ethereum clients available for you to use. The following is a short list:Geth (go-ethereum): https://github.com/ethereum/go-ethereumWebThree (cpp-ethereum): https://github.com/ethereum/cpp-ethereumParity: https://github.com/paritytech/parityMore: https://www.ethereum.org/cliThese are full client implementations that include mining, networking, blocks and transaction processing. You should use these clients after you've sufficiently tested your dapp with Ganache or Truffle Develop and you're ready to deploy to your desired Ethereum network.                Deploying to private networks      Private networks utilize the same technology as with live networks, but with a different configuration. So you can configure any of the Ethereum clients mentioned above to run a private network, and deploy to it in exactly the same way.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Configuration","contents":"                          Configuration                      Location      Your configuration file is called truffle-config.js and is located at the root of your project directory. This file is a Javascript file and can execute any code necessary to create your configuration. It must export an object representing your project configuration like the example below.module.exports = {  networks: {    development: {      host: \"127.0.0.1\",      port: 8545,      network_id: \"*\" // Match any network id    }  }};The default configuration ships with configuration for a single development network, running on 127.0.0.1:8545. There are many other configuration options, detailed below.                Resolving naming conflicts on Windows      Note: This only applies to Truffle version 4 and below.When using the Command Prompt on Windows, the default configuration file name can cause a conflict with the truffle executable, and so you may not be able to run Truffle commands properly on existing projects.This is because of the way that command precedence works on the Command Prompt. The truffle.cmd executable is on the path as part of the npm package, but the truffle.js configuration file is in the actual directory where the truffle command is run. Because .js is an acceptable executable extension by default, truffle.js takes precedence over truffle.cmd, causing unexpected results.Any of the following solutions will remedy this issue:Call the executable file explicitly using its .cmd extension (truffle.cmd compile)Edit the system PATHEXT environment variable and remove .JS; from the list of executable extensionsRename truffle.js to something else (truffle-config.js)Use Windows PowerShell or Git BASH, as these shells do not have this conflict.                General options                      build      Build configuration of your application, if your application requires tight integration with Truffle. Most users likely will not need to configure this option. See the Build Processes section for more details.                networks      Specifies which networks are available for deployment during migrations, as well as specific transaction parameters when interacting with each network (such as gas price, from address, etc.). When compiling and running migrations on a specific network, contract artifacts will be saved and recorded for later use. When your contract abstractions detect that your Ethereum client is connected to a specific network, they'll use the contract artifacts associated that network to simplify app deployment. Networks are identified through Ethereum's net_version RPC call, as well as blockchain URIs.The networks object, shown below, is keyed by a network name and contains a corresponding object that defines the parameters of the network. The networks option is required, as if you have no network configuration, Truffle will not be able to deploy your contracts. The default network configuration provided by truffle init gives you a development network that matches any network it connects to -- this is useful during development, but not suitable for production deployments. To configure Truffle to connect to other networks, simply add more named networks and specify the corresponding network id.The network name is used for user interface purposes, such as when running your migrations on a specific network:$ truffle migrate --network liveExample:networks: {  development: {    host: \"127.0.0.1\",    port: 8545,    network_id: \"*\", // match any network    websockets: true  },  live: {    host: \"178.25.19.88\", // Random IP for example purposes (do not use)    port: 80,    network_id: 1,        // Ethereum public network    // optional config values:    // gas    // gasPrice    // from - default address to use for any transaction Truffle makes during migrations    // provider - web3 provider instance Truffle should use to talk to the Ethereum network.    //          - function that returns a web3 provider instance (see below.)    //          - if specified, host and port are ignored.    // skipDryRun: - true if you don't want to test run the migration locally before the actual migration (default is false)    // timeoutBlocks: - if a transaction is not mined, keep waiting for this number of blocks (default is 50)  }}For each network, if unspecified, transaction options will default to the following values:gas: Gas limit used for deploys. Default is 4712388.gasPrice: Gas price used for deploys. Default is 100000000000 (100 Shannon).from: From address used during migrations. Defaults to the first available account provided by your Ethereum client.provider: Default web3 provider using host and port options: new Web3.providers.HttpProvider(\"http://<host>:<port>\")websockets: You will need this enabled to use the confirmations listener or to hear Events using .on or .once.  Default is false.For each network, you can specify either host / port or provider, but not both. If you need an HTTP provider, we recommend using host and port, while if you need a custom provider such as HDWalletProvider, you must use provider.                Providers      The following network list consists of a local test network and an Infura-hosted Ropsten network, both provided by HDWalletProvider. Make sure you wrap truffle-hdwallet providers in a function closure as shown below to ensure that only one network is ever connected at a time.networks: {  ropsten: {    provider: function() {      return new HDWalletProvider(mnemonic, \"https://ropsten.infura.io/\");    },    network_id: '3',  },  test: {    provider: function() {      return new HDWalletProvider(mnemonic, \"http://127.0.0.1:8545/\");    },    network_id: '*',  },}If you specify host and port instead of provider, Truffle will create its own default HTTP provider using that host and port, and no minimal network connection will be opened, so there is no need to do the function wrapping workaround. That said, you wouldn't be able to use a custom provider in this case.                contracts_directory      The default directory for uncompiled contracts is ./contracts relative to the project root. If you wish to keep your contracts in a different directory you may specify a contracts_directory property.Example:To have Truffle find contracts in ./allMyStuff/someStuff/theContractFolder (recursively) at compile time:module.exports = {  contracts_directory: \"./allMyStuff/someStuff/theContractFolder\",  networks: {    development: {      host: \"127.0.0.1\",      port: 8545,      network_id: \"*\",    }  }};Note: In addition to specifying a relative path, you can also use globs/regular expressions to selectively compile contracts.                contracts_build_directory      The default output directory for compiled contracts is ./build/contracts relative to the project root. This can be changed with the contracts_build_directory key.Examples:To place the built contract artifacts in ./output/contracts:module.exports = {  contracts_build_directory: \"./output\",  networks: {    development: {      host: \"127.0.0.1\",      port: 8545,      network_id: \"*\",    }  }};The built contract artifacts do not need to be inside the project root:module.exports = {  contracts_build_directory: \"../../../output\",  networks: {    development: {      host: \"127.0.0.1\",      port: 8545,      network_id: \"*\",    }  }};Absolute paths will also work. This is not recommended though, as an absolute path may not exist when compiled on another system. If you use absolute paths on Windows, make sure to use double backslashes for paths (example: C:\\\\Users\\\\Username\\\\output).                mocha      Configuration options for the MochaJS testing framework. This configuration expects an object as detailed in Mocha's documentation.Example:mocha: {  useColors: true}                Compiler configuration      In the compilers object you can specify settings related to the compilers used by Truffle.                solc      Solidity compiler settings. Supports optimizer settings for solc.You may specify...any solc-js version listed at solc-bin. Specify the one you want and Truffle will get it for you.a natively compiled solc binary (you'll need to install this yourself, links to help below).a dockerized solc from one of images published here. (You'll also need to pull down the docker image yourself but it's really easy.)a path to a locally available solcTruffle config example:module.exports = {  compilers: {    solc: {      version: <string>, // A version or constraint - Ex. \"^0.5.0\"                         // Can also be set to \"native\" to use a native solc      docker: <boolean>, // Use a version obtained through docker      settings: {        optimizer: {          enabled: <boolean>,          runs: <number>   // Optimize for how many times you intend to run the code        }        evmVersion: <string> // Default: \"byzantium\"      }    }  }}Note: Truffle does not automatically pull Docker images automatically. Make sure you manually pull down the specified version (run 'docker pull ...') before setting the docker property to true.For more information, please see the Solidity documentation on Compiler Input and Output JSON Description.                external compilers      For more advanced use cases with artifact creation you can use the external compilers configuration.You can use this feature by adding a compilers.external object to your Truffle config:module.exports = {  compilers: {    external: {      command: \"./compile-contracts\",      targets: [{        /* compilation output */      }]    }  }}When you run truffle compile, Truffle will run the configured command and look for contract artifacts specified by targets.This new configuration supports a couple of main use cases:Your compilation command outputs Truffle JSON artifacts directly.If your compilation command generates artifacts directly, or generates output that contains all the information for an artifact, configure a target as follows:module.exports = {  compilers: {    external: {      command: \"./compile-contracts\",      targets: [{        path: \"./path/to/artifacts/*.json\"      }]    }  }}Truffle will execute your script, then expand the glob (*) and find all .json files in the listed path and copy those over as artifacts in the build/contracts/ directory.Your compilation command outputs individual parts of an artifact, and you want Truffle to generate the artifacts for you.The above use case might not be sufficient for all use cases. You can configure your target to run an arbitrary post-processing command:module.exports = {  compilers: {    external: {      command: \"./compile-contracts\",      targets: [{        path: \"./path/to/preprocessed-artifacts/*.json\",        command: \"./process-artifact\"      }]    }  }}This will run ./process-artifact for each matched .json file, piping the contents of that file as stdin. Your ./process-artifact command is then expected to output a complete Truffle artifact as stdout.Want to provide the path as a filename instead? Add stdin: false to your target configuration.You can also specify the individual properties of your contracts and have Truffle generate the artifacts itself.module.exports = {  compilers: {    external: {      command: \"./compile-contracts\",      targets: [{        properties: {          contractName: \"MyContract\",          /* other literal properties */        },        fileProperties: {          abi: \"./output/contract.abi\",          bytecode: \"./output/contract.bytecode\",          /* other properties encoded in output files */        }      }]    }  }}Specify properties and/or fileProperties, and Truffle will look for those values when building the artifacts.                plugins      Note: This feature is new and still in a barebones state. Please let usknow how we can improve it!Provides Truffle with a list of installed third-party extensions installed asNPM package dependencies.Truffle plugin support is currently limited to plugins that define customworkflow commands. For more information, see Third-Party Plugin Commands.                EthPM configuration      This configuration applies to the optional ethpm.json file that exists alongside your truffle.js configuration file.                package_name      Name of the package you're publishing. Your package name must be unique to the EthPM registry.Example:package_name: \"adder\"                version      Version of this package, using the semver specification.Example:version: \"0.0.3\"                description      A text description of your package for human readers.Example:description: \"Simple contract to add two numbers\"                authors      An array of authors. Can have any format, but we recommend the format below.Example:authors: [  \"Tim Coulter <tim.coulter@consensys.net>\"]                keywords      An array of keywords that tag this package with helpful categories.Example:keywords: [  \"ethereum\",  \"addition\"],                dependencies      A list of EthPM packages your package depends on, using semver version ranges, like npm.Example:dependencies: {  \"owned\": \"^0.0.1\",  \"erc20-token\": \"1.0.0\"}                license      License to use for this package. Strictly informative.Example:license: \"MIT\",                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Contact the Developers","contents":"                          Contact the developers                      Gitter      The fastest way to get help is to reach out on our community Gitter channel, where hundreds of your fellow Trufflers congregate to answer your questions.                Issue Tracker      If you find a bug or want to recommend a new feature, the best way to reach us is by raising an issue on the GitHub project pages for Truffle, Ganache, or Drizzle. If you're using another one of our tools or libraries, you may want to check out our full list of GitHub projects to be sure you're raising your issue in the best place.                Twitter      If you want to reach out to give us some feedback you can always tweet at us!      SIGN UP FOR THE TRUFFLE MAILING LIST    Sign up today to be a member of the Truffle mailing list. You'll be added to our low volume mailing list which we'll use to communicate future changes, development ideas and allow you to shape Truffle's development.                            Email                                    First Name                                                                            See a way to make this page better? Edit here »                  "},{"title":"Truffle | Contract Abstractions","contents":"                          Contract Abstractions      Truffle provides contract abstractions for interacting with your contracts.  Skip ahead to the api section for a list of contract methods.                Usage      To obtain a contract abstraction you can require it with the contract name from the artifacts object.  Outside of the console this is an object available in migration files, tests, and exec scripts.You would require your contract as follows:const MyContract = artifacts.require(\"MyContract\");You can also obtain one in the developer console.  Your contract types are available here and all you need to do is use the at, deployed, or new method.truffle(development)> const myContract = await MyContract.deployed();You now have access to the following functions on MyContract, as well as many others:at(): Create an instance of MyContract that represents your contract at a specific address.deployed(): Create an instance of MyContract that represents the default address managed by MyContract.new(): Deploy a new version of this contract to the network, getting an instance of MyContract that represents the newly deployed instance.Each instance is tied to a specific address on the Ethereum network, and each instance has a 1-to-1 mapping from Javascript functions to contract functions. For instance, if your Solidity contract had a function defined someFunction(uint value) {} (solidity), then you could execute that function on the network like so:let deployed;MyContract.deployed()  .then((instance) => {    deployed = instance;    return deployed.someFunction(5);  }).then((result) => {    // Do something with the result or continue with more transactions.  });You can also use async/await syntax which is often much less verbose.We will use async/await for the rest of this document but you may also use a promises for interfacing with contract methods as well.const deployed = await MyContract.deployed();const result = await deployed.someFunction(5);// Do something with the result or continue with more transactions.See the processing transaction results section to learn more about the results object obtained from making transactions.Contract methods and events have an EventEmitter interface.  So you can set up handlers like the following:const example = await artifacts.require(\"Example\").deployed();example  .setValue(45)  .on('transactionHash', hash => {})  .on('receipt', receipt => {})  .on('error', error => {})  .on('confirmation', (num, receipt) => {})  .then(receipt => {});example  .ExampleEvent()  .on('data', event => ... etc ... )example  .ExampleEvent()  .once('data', event => ... etc ... )                API      There are two API's you'll need to be aware of. One is the static Contract Abstraction API and the other is the Contract Instance API. The Abstraction API is a set of functions that exist for all contract abstractions, and those function exist on the abstraction itself (i.e., MyContract.at()). In contrast, the Instance API is the API available to contract instances -- i.e., abstractions that represent a specific contract on the network -- and that API is created dynamically based on functions available in your Solidity source file.                Contract Abstraction API      Each contract abstraction -- MyContract in the examples above -- have the following useful functions:                MyContract.new([arg1, arg2, ...], [tx params])      This function take whatever contructor parameters your contract requires and deploys a new instance of the contract to the network. There's an optional last argument which you can use to pass transaction parameters including the transaction from address, gas limit and gas price. This function returns a Promise that resolves into a new instance of the contract abstraction at the newly deployed address.                MyContract.at(address)      This function creates a new instance of the contract abstraction representing the contract at the passed in address. Returns a \"thenable\" object (not yet an actual Promise for backward compatibility). Resolves to a contract abstraction instance after ensuring code exists at the specified address.                MyContract.deployed()      Creates an instance of the contract abstraction representing the contract at its deployed address. The deployed address is a special value given to truffle-contract that, when set, saves the address internally so that the deployed address can be inferred from the given Ethereum network being used. This allows you to write code referring to a specific deployed contract without having to manage those addresses yourself. Like at(), deployed() is thenable, and will resolve to a contract abstraction instance representing the deployed contract after ensuring that code exists at that location and that that address exists on the network being used.                MyContract.link(instance)      Link a library represented by a contract abstraction instance to MyContract. The library must first be deployed and have its deployed address set. The name and deployed address will be inferred from the contract abstraction instance. When this form of MyContract.link() is used, MyContract will consume all of the linked library's events and will be able to report that those events occurred during the result of a transaction.Libraries can be linked multiple times and will overwrite their previous linkage.Note: This method has two other forms, but this form is recommended.                MyContract.link(name, address)      Link a library with a specific name and address to MyContract. The library's events will not be consumed using this form.                MyContract.link(object)      Link multiple libraries denoted by an Object to MyContract. The keys must be strings representing the library names and the values must be strings representing the addresses. Like above, libraries' events will not be consumed using this form.                MyContract.networks()      View a list of network ids this contract abstraction has been set up to represent.                MyContract.setProvider(provider)      Sets the web3 provider this contract abstraction will use to make transactions.                MyContract.setNetwork(network_id)      Sets the network that MyContract is currently representing.                MyContract.hasNetwork(network_id)      Returns a boolean denoting whether or not this contract abstraction is set up to represent a specific network.                MyContract.defaults([new_defaults])      Get's and optionally sets transaction defaults for all instances created from this abstraction. If called without any parameters it will simply return an Object representing current defaults. If an Object is passed, this will set new defaults. Example default transaction values that can be set are:MyContract.defaults({  from: ...,  gas: ...,  gasPrice: ...,  value: ...})Setting a default from address, for instance, is useful when you have a contract abstraction you intend to represent one user (i.e., one address).                MyContract.clone(network_id)      Clone a contract abstraction to get another object that manages the same contract artifacts, but using a different network_id. This is useful if you'd like to manage the same contract but on a different network. When using this function, don't forget to set the correct provider afterward.const MyOtherContract = MyContract.clone(1337);                MyContract.numberFormat = number_type      You can set this property to choose the number format that abstraction methods return.  The default behavior is to return BN.// Choices are:  `[\"BigNumber\", \"BN\", \"String\"].const Example = artifacts.require('Example');Example.numberFormat = 'BigNumber';                MyContract.timeout(block_timeout)      This method allows you to set the block timeout for transactions.  Contract instances created from this abstraction will have the specified transaction block timeout.  This means that if a transaction does not immediately get mined, it will retry for the specified number of blocks.                MyContract.autoGas = <boolean>      If this is set to true, instances created from this abstraction will use web3.eth.estimateGas and then apply a gas multiplier to determine the amount of gas to include with the transaction.  The default value for this is true.  See gasMultiplier.                MyContract.gasMultiplier(gas_multiplier)      This is the value used when autoGas is enabled to determine the amount of gas to include with transactions.  The gas is computed by using web3.eth.estimateGas and multiplying it by the gas multiplier.  The default value is 1.25.                Contract Instance API      Each contract instance is different based on the source Solidity contract, and the API is created dynamically. For the purposes of this documentation, let's use the following Solidity source code below:contract MyContract {  uint public value;  event ValueSet(uint val);  function setValue(uint val) {    value = val;    emit ValueSet(value);  }  function getValue() constant returns (uint) {    return value;  }}From Javascript's point of view, this contract has three functions: setValue, getValue and value. This is because value is public and automatically creates a getter function for it.                Making a transaction via a contract function      When we call setValue(), this creates a transaction. From Javascript:const result = await instance.setValue(5);// result object contains import information about the transactionconsole.log(\"Value was set to\", result.logs[0].args.val);The result object that gets returned looks like this:{  tx: \"0x6cb0bbb6466b342ed7bc4a9816f1da8b92db1ccf197c3f91914fc2c721072ebd\",  receipt: {    // The return value from web3.eth.getTransactionReceipt(hash)    // See https://github.com/ethereum/wiki/wiki/JavaScript-API#web3ethgettransactionreceipt  },  logs: [    {      address: \"0x13274fe19c0178208bcbee397af8167a7be27f6f\",      args: {        val: BigNumber(5),      },      blockHash: \"0x2f0700b5d039c6ea7cdcca4309a175f97826322beb49aca891bf6ea82ce019e6\",      blockNumber: 40,      event: \"ValueSet\",      logIndex: 0,      transactionHash: \"0x6cb0bbb6466b342ed7bc4a9816f1da8b92db1ccf197c3f91914fc2c721072ebd\",      transactionIndex: 0,      type:\"mined\",    },  ],}Note that if the function being executed in the transaction has a return value, you will not get thatreturn value inside this result. You must instead use an event (like ValueSet) and look up the resultin the logs array.                Explicitly making a call instead of a transaction      We can call setValue() without creating a transaction by explicitly using .call:const value = await instance.setValue.call(5);This isn't very useful in this case, since setValue() sets things, and the value we pass won't be saved since we're not creating a transaction.                Calling getters      However, we can get the value using getValue(), using .call(). Calls are always free and don't cost any Ether, so they're good for calling functions that read data off the blockchain:const value = await instance.getValue.call();// value reprsents the `value` storage object in the solidity contract// since the contract returns that value.Even more helpful, however is we don't even need to use .call when a function is marked as constant, because truffle-contract will automatically know that that function can only be interacted with via a call:const value = await instance.getValue();// val reprsents the `value` storage object in the solidity contract// since the contract returns that value.                Processing transaction results      When you make a transaction, you're given a result object that gives you a wealth of information about the transaction. You're given the transaction has (result.tx), the decoded events (also known as logs; result.logs), and a transaction receipt (result.receipt). In the below example, you'll recieve the ValueSet() event because you triggered the event using the setValue() function:const result = await instance.setValue(5);// result.tx => transaction hash, string// result.logs => array of trigger events (1 item in this case)// result.receipt => receipt object                Sending Ether / Triggering the fallback function      You can trigger the fallback function by sending a transaction to this function:const result = instance.sendTransaction({...});// Same result object as above.This is promisified like all available contract instance functions, and has the same API as web3.eth.sendTransaction without the callback. The to value will be automatically filled in for you.If you only want to send Ether to the contract a shorthand is available:const result = await instance.send(web3.toWei(1, \"ether\"));// Same result object as above.                Estimating gas usage      Run this function to estimate the gas usage:const result = instance.setValue.estimateGas(5);// result => estimated gas for this transaction                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Truffle Commands","contents":"                          Truffle Commands      This section will describe every command available in the Truffle application.                Usage      All commands are in the following form:truffle <command> [options]Passing no arguments is equivalent to truffle help, which will display a list of all commands and then exit.                Available commands                      build      Execute build pipeline (if configuration present).truffle buildRequires the build key to be present in the configuration. See the Building your application and Build processes sections for more details.Alert: This command is deprecated. Please use third-party build tools like webpack or grunt, or see our Truffle Boxes for an example.                compile      Compile contract source files.truffle compile [--list <filter>] [--all] [--network <name>] [--quiet]This will only compile contracts that have changed since the last compile, unless otherwise specified.Options:--list <filter>: List all recent stable releases from solc-bin. If filter is specified then it will display only that type of release or docker tags.  The filter parameter must be one of the following: prereleases, releases, latestRelease or docker.--all: Compile all contracts instead of only the contracts changed since last compile.--network <name>: Specify the network to use, saving artifacts specific to that network. Network name must exist in the configuration.--quiet: Suppress all compilation output.                config      Display whether analytics are enabled or disabled and prompt whether to toggle the setting.truffle config [--enable-analytics|--disable-analytics]Options:--enable-analytics|--disable-analytics: Enable or disable analytics.                console      Run a console with contract abstractions and commands available.truffle console [--network <name>] [--verbose-rpc]Spawns an interface to interact with contracts via the command line. Additionally, many Truffle commands are available within the console (without the truffle prefix).Requires an external Ethereum client, such as Ganache or geth. For a console that creates a development and test environment, use truffle develop.See the Using the console section for more details.Options:--network <name>: Specify the network to use. Network name must exist in the configuration.--verbose-rpc: Log communication between Truffle and the Ethereum client.                create      Helper to create new contracts, migrations and tests.truffle create <artifact_type> <ArtifactName>Options:<artifact_type>: Create a new artifact where artifact_type is one of the following: contract, migration or test. The new artifact is created along with one of the following files: contracts/ArtifactName.sol, migrations/####_artifact_name.js or tests/artifact_name.js. (required)<ArtifactName>: Name of new artifact. (required)Camel case names of artifacts will be converted to underscore-separated file names for the migrations and tests. Number prefixes for migrations are automatically generated.                debug      Interactively debug any transaction on the blockchain.truffle debug <transaction_hash>Will start an interactive debugging session on a particular transaction. Allows you to step through each action and replay. See the Debugging your contracts section for more details.Alert: This command is considered experimental.Option:<transaction_hash>: Transaction ID to use for debugging. (required)                deploy      Alias for migrate. See migrate for details.                develop      Open a console with a development blockchaintruffle developSpawns a local development blockchain, and allows you to interact with contracts via the command line. Additionally, many Truffle commands are available within the console (without the truffle prefix).If you want an interactive console but want to use an existing blockchain, use truffle console.See the Using the console section for more details.                exec      Execute a JS module within the Truffle environment.truffle exec <script.js> [--network <name>] [--compile]This will include web3, set the default provider based on the network specified (if any), and include your contracts as global objects while executing the script. Your script must export a function that Truffle can run.See the Writing external scripts section for more details.Options:<script.js>: JavaScript file to be executed. Can include path information if the script does not exist in the current directory. (required)--network <name>: Specify the network to use, using artifacts specific to that network. Network name must exist in the configuration.--compile: Compile contracts before executing the script.                help      Display a list of all commands or information about a specific command.truffle help [<command>]Option:<command>: Display usage information about the specified command.                init      Initialize new and empty Ethereum projecttruffle init [--force]Creates a new and empty Truffle project within the current working directory.Alert: Older versions of Truffle used truffle init bare to create an empty project. This usage has been deprecated. Those looking for the MetaCoin example that used to be available through truffle init should use truffle unbox MetaCoin instead.Option:--force: Initialize project regardless of the current working directory's state. Be careful, this could overwrite existing files that have name conflicts.                install      Install a package from the Ethereum Package Registry.truffle install <package_name>[@<version>]Options:<package_name>: Name of the package as listed in the Ethereum Package Registry. (required)@<version>: When specified, will install a specific version of the package, otherwise will install the latest version.See the Package Management with EthPM section for more details.                migrate      Run migrations to deploy contracts.truffle migrate [--reset] [-f <number>] [--network <name>] [--compile-all] [--verbose-rpc] [--dry-run] [--interactive]Unless specified, this will run from the last completed migration. See the Migrations section for more details.Options:--reset: Run all migrations from the beginning, instead of running from the last completed migration.-f <number>: Run contracts from a specific migration. The number refers to the prefix of the migration file.--network <name>: Specify the network to use, saving artifacts specific to that network. Network name must exist in the configuration.--compile-all: Compile all contracts instead of intelligently choosing which contracts need to be compiled.--verbose-rpc: Log communication between Truffle and the Ethereum client.--dry-run: Fork the network specified and only perform a test migration.--interactive: Prompt to confirm that the user wants to proceed after the dry run.                networks      Show addresses for deployed contracts on each network.truffle networks [--clean]Use this command before publishing your package to see if there are any extraneous network artifacts you don't want published. With no options specified, this package will simply output the current artifact state.Option:--clean: Remove all network artifacts that aren't associated with a named network.                opcode      Print the compiled opcodes for a given contract.truffle opcode <contract_name>Option:<contract_name>: Name of the contract to print opcodes for. Must be a contract name, not a file name. (required)                publish      Publish a package to the Ethereum Package Registry.truffle publishAll parameters are pulled from your project's configuration file. Takes no arguments. See the Package Management with EthPM section for more details.                run      Note: This feature is new and still in a barebones state. Please let usknow how we can improve it!Run a third-party plugin commandtruffle run <command>Option:<command>: Name of a command defined by an installed plugin. (required)Install plugins as NPM package dependencies and configure Truffleto recognize the plugin. For more information, see Third-Party Plugin Commands.                serve      Serve the built app from http://127.0.0.1:8080, rebuilding and redeploying changes as needed. Similar to truffle watch, but with the web server component added.truffle serve [-p <port>] [--network <name>]Options:-p <port>: Specify the port to serve on. Default is 8080.--network <name>: Specify the network to use, using artifacts specific to that network. Network name must exist in the configuration.Alert: This command is deprecated. Please use third-party development servers like webpack-dev-server instead. See our Webpack Truffle Box for an example.                test      Run JavaScript and Solidity tests.truffle test [<test_file>] [--compile-all] [--network <name>] [--verbose-rpc] [--show-events]Runs some or all tests within the test/ directory as specified. See the section on Testing your contracts for more information.Options:<test_file>: Name of the test file to be run. Can include path information if the file does not exist in the current directory.--compile-all: Compile all contracts instead of intelligently choosing which contracts need to be compiled.--network <name>: Specify the network to use, using artifacts specific to that network. Network name must exist in the configuration.--verbose-rpc: Log communication between Truffle and the Ethereum client.--show-events: Log all contract events.                unbox      Download a Truffle Box, a pre-built Truffle project.truffle unbox <box_name>Downloads a Truffle Box to the current working directory. See the list of available boxes.You can also design and create your own boxes!  See the section on Truffle boxes for more information.Options:<box_name>: Name of the Truffle Box. (required)--force: Unbox project in the current directory regardless of its state. Be careful, this will potentially overwrite files that exist in the directory.                version      Show version number and exit.truffle version                watch      Watch filesystem for changes and rebuild the project automatically.truffle watchThis command will initiate a watch for changes to contracts, application, and configuration files. When there's a change, it will rebuild the app as necessary.Alert: This command is deprecated. Please use external tools to watch for filesystem changes and rerun tests.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Testing Your Contracts","contents":"                          Testing Your Contracts                      Framework      Truffle comes standard with an automated testing framework to make testing your contracts a breeze. This framework lets you write simple and manageable tests in two different ways:In Javascript and TypeScript, for exercising your contracts from the outside world, just like your application.In Solidity, for exercising your contracts in advanced, bare-to-the-metal scenarios.Both styles of tests have their advantages and drawbacks. See the next two sections for a discussion of each one.                Location      All test files should be located in the ./test directory. Truffle will only run test files with the following file extensions: .js, .ts, .es, .es6, and .jsx, and .sol. All other files are ignored.                Command      To run all tests, simply run:$ truffle testAlternatively, you can specify a path to a specific file you want to run, e.g.,$ truffle test ./path/to/test/file.js                Clean-room environment      Truffle provides a clean room environment when running your test files. When running your tests against Ganache or Truffle Develop, Truffle will use advanced snapshotting features to ensure your test files don't share state with each other. When running against other Ethereum clients like go-ethereum, Truffle will re-deploy all of your migrations at the beginning of every test file to ensure you have a fresh set of contracts to test against.                Speed and reliability considerations      Both Ganache and Truffle Develop are significantly faster than other clients when running automated tests. Moreover, they contain special features which Truffle takes advantage of to speed up test runtime by almost 90%. As a general workflow, we recommend you use Ganache or Truffle Develop during normal development and testing, and then run your tests once against go-ethereum or another official Ethereum client when you're gearing up to deploy to live or production networks.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Writing Tests in JavaScript","contents":"                          Writing Tests in JavaScript      Truffle uses the Mocha testing framework and Chai for assertions to provide you with a solid framework from which to write your JavaScript tests. Let's dive in and see how Truffle builds on top of Mocha to make testing your contracts a breeze.Note: If you're unfamiliar with writing unit tests in Mocha, please see Mocha's documentation before continuing.                Use contract() instead of describe()      Structurally, your tests should remain largely unchanged from that of Mocha: Your tests should exist in the ./test directory, they should end with a .js extension, and they should contain code that Mocha will recognize as an automated test. What makes Truffle tests different from that of Mocha is the contract() function: This function works exactly like describe() except it enables Truffle's clean-room features. It works like this:Before each contract() function is run, your contracts are redeployed to the running Ethereum client so the tests within it run with a clean contract state.The contract() function provides a list of accounts made available by your Ethereum client which you can use to write tests.Since Truffle uses Mocha under the hood, you can still use describe() to run normal Mocha tests whenever Truffle clean-room features are unnecessary.                Use contract abstractions within your tests      Contract abstractions are the basis for making contract interaction possible from JavaScript (they're basically our flux capacitor). Because Truffle has no way of detecting which contracts you'll need to interact with within your tests, you'll need to ask for those contracts explicitly. You do this by using the artifacts.require() method, a method provided by Truffle that allows you to request a usable contract abstraction for a specific Solidity contract. As you'll see in the example below, you can then use this abstraction to make sure your contracts are working properly.For more information on using contract abstractions, see the Interacting With Your Contracts section.                Using artifacts.require()      Using artifacts.require() within your tests works the same way as using it within your migrations; you just need to pass the name of the contract. See the artifacts.require() documentation in the Migrations section for detailed usage.                Using web3      A web3 instance is available in each test file, configured to the correct provider. So calling web3.eth.getBalance just works!                Examples                      Using .then      Here's an example test provided in the MetaCoin Truffle Box. Note the use of the contract() function, the accounts array for specifying available Ethereum accounts, and our use of artifacts.require() for interacting directly with our contracts.File: ./test/metacoin.jsconst MetaCoin = artifacts.require(\"MetaCoin\");contract(\"MetaCoin\", accounts => {  it(\"should put 10000 MetaCoin in the first account\", () =>    MetaCoin.deployed()      .then(instance => instance.getBalance.call(accounts[0]))      .then(balance => {        assert.equal(          balance.valueOf(),          10000,          \"10000 wasn't in the first account\"        );      }));  it(\"should call a function that depends on a linked library\", () => {    let meta;    let metaCoinBalance;    let metaCoinEthBalance;    return MetaCoin.deployed()      .then(instance => {        meta = instance;        return meta.getBalance.call(accounts[0]);      })      .then(outCoinBalance => {        metaCoinBalance = outCoinBalance.toNumber();        return meta.getBalanceInEth.call(accounts[0]);      })      .then(outCoinBalanceEth => {        metaCoinEthBalance = outCoinBalanceEth.toNumber();      })      .then(() => {        assert.equal(          metaCoinEthBalance,          2 * metaCoinBalance,          \"Library function returned unexpected function, linkage may be broken\"        );      });  });  it(\"should send coin correctly\", () => {    let meta;    // Get initial balances of first and second account.    const account_one = accounts[0];    const account_two = accounts[1];    let account_one_starting_balance;    let account_two_starting_balance;    let account_one_ending_balance;    let account_two_ending_balance;    const amount = 10;    return MetaCoin.deployed()      .then(instance => {        meta = instance;        return meta.getBalance.call(account_one);      })      .then(balance => {        account_one_starting_balance = balance.toNumber();        return meta.getBalance.call(account_two);      })      .then(balance => {        account_two_starting_balance = balance.toNumber();        return meta.sendCoin(account_two, amount, { from: account_one });      })      .then(() => meta.getBalance.call(account_one))      .then(balance => {        account_one_ending_balance = balance.toNumber();        return meta.getBalance.call(account_two);      })      .then(balance => {        account_two_ending_balance = balance.toNumber();        assert.equal(          account_one_ending_balance,          account_one_starting_balance - amount,          \"Amount wasn't correctly taken from the sender\"        );        assert.equal(          account_two_ending_balance,          account_two_starting_balance + amount,          \"Amount wasn't correctly sent to the receiver\"        );      });  });});This test will produce the following output:  Contract: MetaCoin    √ should put 10000 MetaCoin in the first account (83ms)    √ should call a function that depends on a linked library (43ms)    √ should send coin correctly (122ms)  3 passing (293ms)                Using async/await      Here is a similar example, but using async/await notation: const MetaCoin = artifacts.require(\"MetaCoin\");contract(\"2nd MetaCoin test\", async accounts => {  it(\"should put 10000 MetaCoin in the first account\", async () => {    let instance = await MetaCoin.deployed();    let balance = await instance.getBalance.call(accounts[0]);    assert.equal(balance.valueOf(), 10000);  });  it(\"should call a function that depends on a linked library\", async () => {    let meta = await MetaCoin.deployed();    let outCoinBalance = await meta.getBalance.call(accounts[0]);    let metaCoinBalance = outCoinBalance.toNumber();    let outCoinBalanceEth = await meta.getBalanceInEth.call(accounts[0]);    let metaCoinEthBalance = outCoinBalanceEth.toNumber();    assert.equal(metaCoinEthBalance, 2 * metaCoinBalance);  });  it(\"should send coin correctly\", async () => {    // Get initial balances of first and second account.    let account_one = accounts[0];    let account_two = accounts[1];    let amount = 10;    let instance = await MetaCoin.deployed();    let meta = instance;    let balance = await meta.getBalance.call(account_one);    let account_one_starting_balance = balance.toNumber();    balance = await meta.getBalance.call(account_two);    let account_two_starting_balance = balance.toNumber();    await meta.sendCoin(account_two, amount, { from: account_one });    balance = await meta.getBalance.call(account_one);    let account_one_ending_balance = balance.toNumber();    balance = await meta.getBalance.call(account_two);    let account_two_ending_balance = balance.toNumber();    assert.equal(      account_one_ending_balance,      account_one_starting_balance - amount,      \"Amount wasn't correctly taken from the sender\"    );    assert.equal(      account_two_ending_balance,      account_two_starting_balance + amount,      \"Amount wasn't correctly sent to the receiver\"    );  });});This test will produce identical output to the previous example.                Specifying tests      You can limit the tests being executed to a specific file as follows:truffle test ./test/metacoin.jsSee the full command reference for more information.                Advanced      Truffle gives you access to Mocha's configuration so you can change how Mocha behaves. See the project configuration section for more details.                TypeScript File Support      Truffle now supports tests saved as a .ts TypeScript file. Please see the Writing Tests in JavaScript guide for more information.                      See a way to make this page better? Edit here »                  "},{"title":"Truffle | Writing Tests in Solidity","contents":"                          Writing Tests in Solidity      Solidity test contracts live alongside Javascript tests as .sol files. When truffle test is run, they will be included as a separate test suite per test contract. These contracts maintain all the benefits of the Javascript tests: namely a clean-room environment per test suite, direct access to your deployed contracts and the ability to import any contract dependency. In addition to these features, Truffle's Solidity testing framework was built with the following issues in mind:Solidity tests shouldn't extend from any contract (like a Test contract). This makes your tests as minimal as possible and gives you complete control over the contracts you write.Solidity tests shouldn't be beholden to any assertion library. Truffle provides a default assertion library for you, but you can change this library at any time to fit your needs.You should be able to run your Solidity tests against any Ethereum client.                Example      Let's take a look at an example Solidity test before diving too deeply. Here's the example Solidity test provided for you by truffle unbox metacoin:import \"truffle/Assert.sol\";import \"truffle/DeployedAddresses.sol\";import \"../contracts/MetaCoin.sol\";contract TestMetacoin {  function testInitialBalanceUsingDeployedContract() {    MetaCoin meta = MetaCoin(DeployedAddresses.MetaCoin());    uint expected = 10000;    Assert.equal(meta.getBalance(tx.origin), expected, \"Owner should have 10000 MetaCoin initially\");  }  function testInitialBalanceWithNewMetaCoin() {    MetaCoin meta = new MetaCoin();    uint expected = 10000;    Assert.equal(meta.getBalance(tx.origin), expected, \"Owner should have 10000 MetaCoin initially\");  }}This produces the following output:$ truffle testCompiling ConvertLib.sol...Compiling MetaCoin.sol...Compiling truffle/Assert.solCompiling truffle/DeployedAddresses.solCompiling ../test/TestMetacoin.sol...  TestMetacoin    ✓ testInitialBalanceUsingDeployedContract (61ms)    ✓ testInitialBalanceWithNewMetaCoin (69ms)  2 passing (3s)                Test structure      To better understand whats happening, let's discuss things in more detail.                Assertions      Your assertion functions like Assert.equal() are provided to you by the truffle/Assert.sol library. This is the default assertion library, however you can include your own assertion library so long as the library loosely integrates with Truffle's test runner by triggering the correct assertion events. You can find all available assertion functions in Assert.sol.                Deployed addresses      The addresses of your deployed contracts (i.e., contracts that were deployed as part of your migrations) are available through the truffle/DeployedAddresses.sol library. This is provided by Truffle and is recompiled and relinked before each suite is run to provide your tests with Truffle's a clean room environment. This library provides functions for all of your deployed contracts, in the form of:DeployedAddresses.<contract name>();This will return an address that you can then use to access that contract. See the example test above for usage.In order to use the deployed contract, you'll have to import the contract code into your test suite. Notice import \"../contracts/MetaCoin.sol\"; in the example. This import is relative to the test contract, which exists in the ./test directory, and it goes outside of the test directory in order to find the MetaCoin contract. It then uses that contract to cast the address to the MetaCoin type.                Test contract names      All test contracts must start with Test, using an uppercase T. This distinguishes this contract apart from test helpers and project contracts (i.e., the contracts under test), letting the test runner know which contracts represent test suites.                Test function names      Like test contract names, all test functions must start with test, lowercase. Each test function is executed as a single transaction, in order of appearance in the test file (like your Javascript tests). Assertion functions provided by truffle/Assert.sol trigger events that the test runner evaluates to determine the result of the test. Assertion functions return a boolean representing the outcome of the assertion which you can use to return from the test early to prevent execution errors (as in, errors that Ganache or Truffle Develop will expose).                before / after hooks      You are provided many test hooks, shown in the example below. These hooks are beforeAll, beforeEach, afterAll and afterEach, which are the same hooks provided by Mocha in your Javascript tests. You can use these hooks to perform setup and teardown actions before and after each test, or before and after each suite is run. Like test functions, each hook is executed as a single transaction. Note that some complex tests will need to perform a significant amount of setup that might overflow the gas limit of a single transaction; you can get around this limitation by creating many hooks with different suffixes, like in the example below:import \"truffle/Assert.sol\";contract TestHooks {  uint someValue;  function beforeEach() {    someValue = 5;  }  function beforeEachAgain() {    someValue += 1;  }  function testSomeValueIsSix() {    uint expected = 6;    Assert.equal(someValue, expected, \"someValue should have been 6\");  }}This test contract also shows that your test functions and hook functions all share the same contract state. You can setup contract data before the test, use that data during the test, and reset it afterward in preparation for the next one. Note that just like your Javascript tests, your next test function will continue from the state of the previous test function that ran.                Advanced features      Solidity tests come with a few advanced features to let you test specific use cases within Solidity.                Testing for exceptions      You can easily test if your contract should or shouldn't raise an exception (i.e., for require()/assert()/revert() statements; throw on previous versions of Solidity).This topic was first written about by guest writer Simon de la Rouviere in his tutorial Testing for Throws in Truffle Solidity Tests.  N.B. that the tutorial makes heavy use of exceptions via the deprecated keyword throw, replaced by revert(), require(), and assert() starting in Solidity v0.4.13.                Testing ether transactions      You can also test how your contracts react to receiving Ether, and script that interaction within Solidity. To do so, your Solidity test should have a public function that returns a uint, called initialBalance. This can be written directly as a function or a public variable, as shown below. When your test contract is deployed to the network, Truffle will send that amount of Ether from your test account to your test contract. Your test contract can then use that Ether to script Ether interactions within your contract under test. Note that initialBalance is optional and not required.import \"truffle/Assert.sol\";import \"truffle/DeployedAddresses.sol\";import \"../contracts/MyContract.sol\";contract TestContract {  // Truffle will send the TestContract one Ether after deploying the contract.  uint public initialBalance = 1 ether;  function testInitialBalanceUsingDeployedContract() {    MyContract myContract = MyContract(DeployedAddresses.MyContract());    // perform an action which sends value to myContract, then assert.    myContract.send(...);  }  function () {    // This will NOT be executed when Ether is sent. \\o/  }}Note that Truffle sends Ether to your test contract in a way that does not execute a fallback function, so you can still use the fallback function within your Solidity tests for advanced test cases.                      See a way to make this page better? Edit here »                  "}];
